	(391, '부추김치조림밥', '호토모토', '분식', 7000, NULL, NULL, NULL, '풍성한 해물찜과 짭조름한 닭찜을 함께 담아 누구나 찜 하고 싶은 메뉴', 778),
	(392, '버섯튀김', '바니스푼', '양식', 5000, NULL, NULL, NULL, '따뜻한 미역국과 잡채, 고소한 새우튀김, 달콤한 화이트 티라미수 컵케익을 함께 구성한 생일 도시락', 590),
	(393, '얼큰해물덮밥', '한솥', '일식', 8000, NULL, NULL, NULL, '뼈와 가시를 발라내 먹기 좋은 고등어를 한국인 입맛에 맞는 칼칼한 특제 양념 소스로 조렸습니다. 홍고추와 통마늘로 비린내까지 잡아 고등어 순살의 맛이 맛깔스럽습니다.', 627),
	(394, '영양닭볶음', '본', '동남아식', 5000, NULL, NULL, NULL, '봄의 기운을 담은 3색 나물 영양밥과 고소한 우삼겹구이, 매콤한 오징어볶음을 한 상에!', 976),
	(395, '우리감자볶음', '호토모토', '일식', 3000, NULL, NULL, NULL, '[베스트 & 스테디셀러 SINCE 2007] 12가지 다양한 반찬으로 구성된 프리미엄 도시락입니다. 푸짐한 반찬과 함께 촉촉하고 부드러운 연어구이와 치킨이 구성되어 있어 부족하지 않고 든든하게 드실 수 있는 도시락 입니다. 생수와 조미 김이 함께 제공 됩니다.', 1069),
	(396, '더블갈비조림밥', '잇슬림', '다이어트식', 7500, NULL, NULL, NULL, '육즙이 살아있고 부드러운 함박스테이크를 따끈하게 즐겨보세요. 국내산 돼지고기와 호주산 쇠고기, 생 빵가루 등 좋은 재료로만 만든 함박스테이크에 풍미 좋은 데미그라스까지 곁들였습니다. 칼 없이 젓가락으로도 잘라 드실 수 있을 만큼 부드럽습니다.', 381),
	(397, '속초소시지정식', '런치바스켓', '동남아식', 4000, NULL, NULL, NULL, '매콤달콤한 고추장 양념으로 맛을 낸 제육볶음에 부추를 곁들여 6가지 한식반찬과 함께 즐길 수 있는 도시락', 963),
	(398, '우리문어비빔밥', '호밀', '중식', 4500, NULL, NULL, NULL, '고소한 치킨 가라아게에 간장소스와 마요네즈을 비벼먹는 인기만점 도시락', 923),
	(399, '의정부갈치국', '더큰', '동남아식', 7500, NULL, NULL, NULL, '잘 익은 묵은지와 돼지고기로 끓인 얼큰한 김치찌개', 1034),
	(400, '치즈어묵정식', '바니스푼', '분식', 6000, NULL, NULL, NULL, '[베스트 & 스테디셀러 SINCE 2008] 고등어데리야끼, 소 불고기, 새우튀김, 치킨 등 누구나 좋아하는 메뉴로 구성된 도시락입니다.', 510);
