	INSERT INTO `PURCHASE` (`PURCHASE_SEQ`,`TO_ID`,`MEMBER_ID`, `MASSAGE`) VALUES
	(4345, 'rm2to2yf','test1',   '국무회의는 정부의 권한에 속하는 중요한 정책을 심의한다. 헌법재판소는 법관의 자격을 가진 9인의 재판관으로 구성하며, 재판관은 대통령이 임명한다.'),
	(4346, '64aha9e','test1',   '대법원장과 대법관이 아닌 법관의 임기는 10년으로 하며, 법률이 정하는 바에 의하여 연임할 수 있다.'),
	(4347, 'gimoc1z4','test1',   '이 헌법공포 당시의 국회의원의 임기는 제1항에 의한 국회의 최초의 집회일 전일까지로 한다.'),
	(4348, 'yibuoo','test1',   '국가는 농지에 관하여 경자유전의 원칙이 달성될 수 있도록 노력하여야 하며, 농지의 소작제도는 금지된다.'),
	(4349, 'gg800g3v','test1',   '농업생산성의 제고와 농지의 합리적인 이용을 위하거나 불가피한 사정으로 발생하는 농지의 임대차와 위탁경영은 법률이 정하는 바에 의하여 인정된다.'),
	(4350, '123lizty','test1',   '군인 또는 군무원이 아닌 국민은 대한민국의 영역안에서는 중대한 군사상 기밀·초병·초소·유독음식물공급·포로·군용물에 관한 죄중 법률이 정한 경우와 비상계엄이 선포된 경우를 제외하고는 군사법원의 재판을 받지 아니한다.'),
	(4351, '7g44td', 'test1',   '국무위원은 국무총리의 제청으로 대통령이 임명한다. 국회는 정부의 동의없이 정부가 제출한 지출예산 각항의 금액을 증가하거나 새 비목을 설치할 수 없다.'),
	(4352, 'nfbotr0x','test1',   '감사원의 조직·직무범위·감사위원의 자격·감사대상공무원의 범위 기타 필요한 사항은 법률로 정한다.'),
	(4353, 'jnp30ud2', 'test1',  '군인은 현역을 면한 후가 아니면 국무총리로 임명될 수 없다.'),
	(4354, '9aumaeg','test1',  '대통령은 제3항과 제4항의 사유를 지체없이 공포하여야 한다.'),
	(4355, 'test1', 'trpbhue',  '국무회의는 정부의 권한에 속하는 중요한 정책을 심의한다. 헌법재판소는 법관의 자격을 가진 9인의 재판관으로 구성하며, 재판관은 대통령이 임명한다.'),
