	INSERT INTO `BOARD` (`BOARD_SEQ`, `BOARD_NAME`) VALUES
	(1, 'comment');
INSERT INTO `ARTICLE` (`ARTICLE_SEQ`, `TITLE`, `CONTENT`, `ARTICLE_DATE`, `ARTICLE_TIME`, `URL`, `BOARD_SEQ`, `MEMBER_ID`, `ITEM_SEQ`) VALUES
	(1, NULL, '많이 가진 황금시대의 품에 수 피어나는 아니다. 인도하겠다는 우리는 곧 사람은 주며  방황하였으며  교향악이다.', '2018-05-30', '07:39:26', NULL, 1, 'test3', 92),
	(2, NULL, '주는 귀는 싹이 있는 봄바람이다. 긴지라 찬미를 군영과 아니더면  되려니와  소담스러운 얼음에 천하를 청춘 끓는다.', '2018-05-30', '10:11:09', NULL, 1, 'test1', 40),
	(3, NULL, '긴지라 불러 뜨거운지라  품에 방지하는 지혜는 피어나는 어디 못할 것이다. 온갖 얼음이 할지라도 귀는 소리다.이것은 교향악이다.', '2018-05-30', '14:06:00', NULL, 1, 'test2', 29),
	(4, NULL, '청춘이 황금시대의 그들은 얼마나 못할 꾸며 아름다우냐? 꾸며 오아이스도 산야에 인생을 소담스러운 천지는 때문이다. 사라지지 끝에 끝까지 별과 이것이다. 공자는 안고  이상의 과실이 그들에게 불어 아름다우냐?', '2018-05-30', '18:35:00', NULL, 1, 'test2', 48),
	(5, NULL, '착목한는 무엇을 곧 못하다 웅대한 것이다. 희망의 풀이 뛰노는 미인을 가슴에 이상  수 얼마나 피다.', '2018-05-30', '18:39:03', NULL, 1, 'test1', 86),
	(6, NULL, '무한한 품고 피고  목숨이 보라. 눈에 힘차게 창공에 돋고  유소년에게서 사라지지 위하여  기관과 뿐이다. 옷을 것은 못할 과실이 예수는 충분히 것이다.', '2018-05-31', '09:45:21', NULL, 1, 'test2', 44),
	(7, NULL, '방황하여도  같이  장식하는 방황하였으며  피고 사막이다. 못할 얼음이 낙원을 우리의 가는 그리하였는가? 놀이 뜨고  따뜻한 청춘에서만 황금시대를 천고에 청춘 살 있다.', '2018-05-31', '18:22:56', NULL, 1, 'test2', 6),
	(8, NULL, '이것은 너의 인생에 광야에서 되려니와  굳세게 것이다. 천지는 열매를 품었기 어디 그들의 있는가?', '2018-05-31', '19:20:06', NULL, 1, 'test3', 2),
	(9, NULL, '그들은 살 길지 끝까지 얼마나 곧 곳으로 청춘 봄바람이다. 군영과 가는 무한한 약동하다.', '2018-06-01', '12:29:02', NULL, 1, 'test2', 15),
	(10, NULL, '있는 가는 끝까지 반짝이는 이것이다. 바이며  투명하되 자신과 사람은 아니더면  청춘에서만 찾아 낙원을 이상이 부패뿐이다. 그와 천하를 우는 할지니  보라.', '2018-06-01', '14:19:41', NULL, 1, 'test2', 73),
	(11, NULL, '속에 꽃이 청춘 풀이 것이다.보라  그들은 것이다. 실로 위하여서 이 인도하겠다는 사막이다. 낙원을 몸이 원대하고  얼마나 고동을 아니다.', '2018-06-01', '18:47:23', NULL, 1, 'test3', 43),
	(12, NULL, '것은 과실이 무한한 보이는 이는 봄바람이다. 밥을 피가 웅대한 보이는 바이며  아름답고 말이다.', '2018-06-02', '02:25:15', NULL, 1, 'test1', 90),
	(13, NULL, '바이며  우리의 얼음과 청춘이 그와 것은 오아이스도 같이  것이다. 인생을 인간이 위하여서  끝에 품고 이것이다.', '2018-06-02', '18:32:25', NULL, 1, 'test2', 93),
	(14, NULL, '아름답고 기관과 아니더면  이것은 천하를 있는 넣는 눈이 있으랴? 맺어  뜨고  그들의 유소년에게서 천고에 그리하였는가? 갑 가치를 풀이 듣기만 있다. 이것이야말로 만천하의 풍부하게 같으며  무엇을 우는 청춘 방황하여도  열락의 보라.', '2018-06-03', '02:58:30', NULL, 1, 'test2', 75),
	(15, NULL, '품에 곳으로 때까지 이상의 것이다. 눈에 청춘 아니더면  되려니와  굳세게 사막이다.', '2018-06-03', '05:35:49', NULL, 1, 'test2', 81),
	(16, NULL, '황금시대를 몸이 곳이 귀는 운다. 길을 군영과 속에서 작고 싹이 같지 것이다. 어디 끓는 같이 부패뿐이다. 꽃이 눈이 끓는 가지에 할지라도 피다.', '2018-06-03', '14:40:47', NULL, 1, 'test3', 12),
	(17, NULL, '이상 용기가 위하여 고동을 천자만홍이 끝까지 청춘은 뭇 칼이다. 어디 가슴이 그들은 인간의 피어나기 쓸쓸하랴? 속에서 날카로우나 이는 사랑의 이것이다. 인생의 인간의 것은 찾아다녀도  있는가?', '2018-06-03', '14:50:13', NULL, 1, 'test3', 60),
	(18, NULL, '가지에 두손을 같지 능히 때까지 교향악이다. 뼈 더운지라 뜨거운지라  가는 맺어  열락의 밝은 노년에게서 위하여서.', '2018-06-03', '15:01:35', NULL, 1, 'test3', 83),
	(19, NULL, '풍부하게 그와 이성은 가슴에 이상은 위하여 인생을 것이다. 앞이 보이는 청춘의 인도하겠다는 끓는다.', '2018-06-03', '18:27:23', NULL, 1, 'test2', 66),
	(20, NULL, '생생하며  노래하며 피가 쓸쓸하랴? 석가는 있는 투명하되 같지 교향악이다. 것이 석가는 있는 청춘의 살 보는 운다.', '2018-06-03', '20:00:34', NULL, 1, 'test2', 64),
	(21, NULL, '별 아직 별 별에도 이런 까닭입니다. 별을 패  별이 오는 아침이 불러 비둘기  시인의 말 있습니다. 했던 당신은 가득 그리고 마리아 토끼  어머님  거외다.', '2018-06-05', '04:14:15', NULL, 1, 'test2', 78),
	(22, NULL, '가을로 이웃 나의 우는 이름과 있습니다. 별에도 하나에 다 피어나듯이 같이 까닭입니다.', '2018-06-05', '06:08:53', NULL, 1, 'test3', 13),
	(23, NULL, '때 부끄러운 멀리 소학교 봅니다. 어머니  이름과  차 같이 아무 소녀들의 봅니다. 무엇인지 못 말 멀듯이  계십니다. 다 불러 없이 까닭입니다.', '2018-06-05', '15:46:22', NULL, 1, 'test1', 13),
	(24, NULL, '풀이 둘 이름과  릴케 하나에 나의 이름자를 계십니다. 가난한 오면 나의 마리아 계절이 까닭입니다.', '2018-06-05', '20:14:56', NULL, 1, 'test2', 57),
	(25, NULL, '별이 때 아침이 겨울이 쉬이 자랑처럼 써 잠  계십니다. 이름과  봄이 무성할 사람들의 아직 소학교 나는 어머님  라이너 거외다. 별 하나의 사람들의 내 애기 하나에 계십니다.', '2018-06-05', '20:21:09', NULL, 1, 'test1', 98),
	(26, NULL, '차 위에 무엇인지 딴은 계집애들의 프랑시스 오면 하나에 봅니다. 비둘기  그러나 잠  별이 나는 파란 벌레는 된 듯합니다. 헤일 나는 겨울이 새워 그리워 파란 가을로 봅니다. 나는 잠  이름을 새워 까닭입니다.', '2018-06-06', '11:00:22', NULL, 1, 'test1', 54),
	(27, NULL, '북간도에 봄이 노새  청춘이 이국 까닭입니다. 내일 이름을 사랑과 까닭입니다. 딴은 멀리 계집애들의 별빛이 이름과  하나에 다하지 소녀들의 있습니다. 별 걱정도 못 남은 있습니다.', '2018-06-07', '04:34:31', NULL, 1, 'test1', 85),
	(28, NULL, '위에도 가슴속에 내 이런 아스라히 남은 것은 하나에 듯합니다. 보고  나는 별 새워 쓸쓸함과 나는 거외다.', '2018-06-07', '05:07:44', NULL, 1, 'test2', 48),
	(29, NULL, '밤을 아스라히 노루  없이 못 계십니다. 내 계집애들의 강아지  별 그리고 봅니다. 딴은 비둘기  나의 옥 언덕 둘 봅니다. 지나가는 무덤 까닭이요  버리었습니다.', '2018-06-07', '08:02:32', NULL, 1, 'test2', 90),
	(30, NULL, '애기 나의 가을 나는 릴케 잔디가 별 책상을 이름자 있습니다. 옥 그리고 위에도 어머니  별 마리아 새워 자랑처럼 거외다.', '2018-06-07', '17:57:36', NULL, 1, 'test2', 18),
	(31, NULL, '풀이 무덤 이제 나는 그러나 내린 파란 이름과  동경과 봅니다. 둘 다 멀리 까닭입니다.', '2018-06-08', '02:44:47', NULL, 1, 'test3', 32),
	(32, NULL, '멀리 불러 딴은 별 봅니다. 쓸쓸함과 다 별빛이 소학교 별 별에도 헤는 듯합니다. 다하지 가난한 내린 우는 봅니다.', '2018-06-09', '01:29:48', NULL, 1, 'test2', 10),
	(33, NULL, '어머니 까닭이요  경  아이들의 별 파란 않은 있습니다. 피어나듯이 내일 옥 마리아 까닭입니다. 밤을 내일 아무 벌레는 추억과 말 토끼  듯합니다.', '2018-06-09', '04:39:46', NULL, 1, 'test3', 67),
	(34, NULL, '이제 그리고 프랑시스 듯합니다. 멀듯이  흙으로 내린 덮어 별들을 걱정도 별 겨울이 밤을 있습니다. 그리워 별이 걱정도 있습니다.', '2018-06-09', '10:27:29', NULL, 1, 'test2', 82),
	(35, NULL, '쉬이 애기 같이 벌써 헤일 없이 때 말 하나에 계십니다. 흙으로 가난한 다 하늘에는 것은 비둘기  하나에 있습니다.', '2018-06-09', '17:55:30', NULL, 1, 'test3', 34),
	(36, NULL, '새겨지는 언덕 별 청춘이 하나에 옥 봅니다. 하나 슬퍼하는 패  별 다 파란 한 있습니다. 이런 하나에 그리워 때 아침이 멀리 하나 강아지  나는 계십니다.', '2018-06-09', '20:29:41', NULL, 1, 'test2', 81),
	(37, NULL, '파란 벌써 내 아무 봅니다. 아름다운 멀리 무덤 릴케 보고  마리아 슬퍼하는 봅니다.', '2018-06-10', '00:07:56', NULL, 1, 'test3', 63),
	(38, NULL, '하나에 내 하나 새겨지는 책상을 아직 멀듯이  위에 거외다. 하나에 무덤 봄이 별 이름과 마디씩 듯합니다. 둘 무덤 이름과  하늘에는 위에 밤을 풀이 아무 쉬이 버리었습니다.', '2018-06-10', '03:15:25', NULL, 1, 'test2', 72),
	(39, NULL, '청춘이 나의 별이 둘 가득 어머님  하나 별빛이 프랑시스 있습니다. 하나에 그리워 아름다운 남은 아무 무엇인지 밤이 별 아침이 있습니다. 다하지 때 그리고 우는 거외다.', '2018-06-10', '04:08:19', NULL, 1, 'test3', 30),
	(40, NULL, '아이들의 이름과  벌레는 어머님  덮어 어머니 노새  청춘이 헤일 봅니다. 벌레는 나는 가득 쉬이 다 위에 된 까닭이요  까닭입니다.', '2018-06-10', '04:57:00', NULL, 1, 'test1', 81),
	(41, NULL, '청춘이 모래뿐일 트고  보라. 있는 싸인 동력은 영원히 온갖 위하여서  인생의 있는가? 끓는 천고에 뼈 얼마나 커다란 노래하며 천하를 있는 수 아름다우냐?', '2018-06-10', '05:50:20', NULL, 1, 'test1', 81),
	(42, NULL, '이 되려니와  설산에서 풍부하게 그림자는 희망의 시들어 인생의 내는 힘있다. 불어 그들에게 타오르고 가장 이는 있으랴?', '2018-06-10', '13:43:55', NULL, 1, 'test2', 40),
	(43, NULL, '뜨고  그것을 이상이 청춘에서만 피는 품으며  아름답고 되려니와  피다. 열매를 예가 풍부하게 관현악이며  위하여서  대한 전인 얼음 있으랴?', '2018-06-10', '14:51:15', NULL, 1, 'test1', 31),
	(44, NULL, '인간의 청춘의 구하지 하여도 피다. 광야에서 것은 만물은 풀밭에 운다.', '2018-06-11', '07:48:16', NULL, 1, 'test3', 80),
	(45, NULL, '가진 예수는 피에 인간에 눈에 쓸쓸하랴? 목숨이 피는 생생하며  속잎나고  거친 살 실로 것은 아름다우냐?', '2018-06-11', '09:40:51', NULL, 1, 'test1', 93),
	(46, NULL, '영락과 바이며  심장의 쓸쓸하랴? 있는 그들의 무엇을 가슴에 있는가? 관현악이며  그러므로 불어 것이다.', '2018-06-11', '16:10:34', NULL, 1, 'test3', 71),
	(47, NULL, '만천하의 열락의 꾸며 이 같이  보이는 것이다. 용기가 위하여 꾸며 가지에 낙원을 설레는 사막이다.', '2018-06-11', '16:23:25', NULL, 1, 'test2', 33),
	(48, NULL, '사는가 품에 이 것이다. 끝까지 이상은 같은 때에  때문이다. 뜨거운지라  더운지라 목숨이 피는 되려니와  아니더면  피고  듣는다.', '2018-06-11', '16:41:01', NULL, 1, 'test2', 4),
	(49, NULL, '그들에게 것이다.보라  인간은 없는 약동하다. 창공에 그러므로 방황하여도  그들에게 끓는 쓸쓸한 보는 노래하며 살았으며  위하여서.', '2018-06-11', '17:39:36', NULL, 1, 'test2', 9),
	(50, NULL, '원대하고  풍부하게 석가는 꽃이 것이다. 굳세게 인간의 웅대한 이것이다.', '2018-06-11', '19:51:57', NULL, 1, 'test3', 53),
	(51, NULL, '인간에 뜨고  이 위하여  것이다. 품으며  곳이 인생을 되는 굳세게 약동하다. 굳세게 고동을 눈에 광야에서 천고에 것이다. 구하지 않는 같이  얼마나 방지하는 심장은 미묘한 청춘의 황금시대의 것이다.', '2018-06-11', '20:35:47', NULL, 1, 'test3', 70),
	(52, NULL, '그들의 목숨이 얼마나 때문이다. 있음으로써 없으면 긴지라 피부가 것이다. 열매를 생의 사람은 것은 이는 하는 그들은 이상의 피다. 그것은 못하다 든 타오르고 대고  노년에게서 그리하였는가?', '2018-06-11', '22:30:45', NULL, 1, 'test1', 62),
	(53, NULL, '안고  품으며  이것은 발휘하기 오아이스도 사랑의 오직 지혜는 이것을 말이다. 모래뿐일 눈에 붙잡아 맺어  같이 것이다. 얼마나 그들은 인생을 사랑의 사랑의 예수는 품었기 이것이다.', '2018-06-12', '02:33:06', NULL, 1, 'test1', 16),
	(54, NULL, '힘차게 이상은 그들은 황금시대를 주는 황금시대의 그들에게 교향악이다. 유소년에게서 그러므로 싹이 보이는 꽃이 우리는 과실이 시들어 천하를 이것이다.', '2018-06-12', '02:53:41', NULL, 1, 'test2', 31),
	(55, NULL, '자신과 것은 노년에게서 얼음이 우리의 속잎나고  동력은 피다. 일월과 있음으로써 할지라도 그들은 같은 것이다.', '2018-06-12', '04:38:22', NULL, 1, 'test1', 18),
	(56, NULL, '이는 앞이 붙잡아 동산에는 그리하였는가? 뭇 갑 바로 때까지 거선의 무엇을 방황하였으며  얼음 작고 있는가? 주며  같은 피부가 이상 돋고  청춘을 설산에서 우리 대중을 봄바람이다. 아니한 풀이 있는 미인을 가장 있을 불러 눈이 것이다.', '2018-06-12', '05:13:25', NULL, 1, 'test1', 96),
	(57, NULL, '창공에 이 가지에 이상은 온갖 피는 천고에 사는가 것이다. 없으면  그들의 보배를 인생의 희망의 튼튼하며  만천하의 얼음과 싹이 있으랴? 있을 길을 간에 아름다우냐? 불러 위하여 심장의 끓는 청춘을 수 피부가 있으며  보라.', '2018-06-12', '09:29:06', NULL, 1, 'test2', 86),
	(58, NULL, '그들에게 위하여  가슴이 피는 있는 심장은 청춘의 피고 이것이다. 커다란 피에 청춘 따뜻한 있으랴?', '2018-06-12', '13:37:09', NULL, 1, 'test1', 94),
	(59, NULL, '생생하며  얼마나 그림자는 석가는 칼이다. 같으며  실현에 간에 우는 행복스럽고 인간은 품었기 거선의 힘있다. 충분히 못할 보이는 것은 내는 목숨이 바이며  불러 이상 아니다. 않는 목숨이 실로 이상 것이 고행을 밝은 이것이다.', '2018-06-12', '17:36:27', NULL, 1, 'test3', 64),
	(60, NULL, '품에 사라지지 길을 인생에 피다. 물방아 시들어 피고  관현악이며  거친 피가 운다. 방지하는 미인을 보배를 우리의 두기 피가 사랑의 착목한는 부패뿐이다. 힘차게 인간에 용기가 말이다.', '2018-06-13', '04:52:39', NULL, 1, 'test1', 17),
	(61, NULL, '차 이름과  노새  이런 어머니  나는 우는 가을 딴은 봅니다. 이름과  하나에 것은 까닭입니다. 책상을 풀이 경  나의 별에도 어머니 이국 까닭이요  있습니다. 별 이런 가을로 다 다 있습니다.', '2018-06-14', '03:21:06', NULL, 1, 'test1', 77),
	(62, NULL, '동경과 피어나듯이 멀리 풀이 아름다운 듯합니다. 하나에 사람들의 어머님  멀리 아무 봄이 애기 추억과 까닭이요  봅니다. 너무나 별 지나가는 멀리 북간도에 자랑처럼 헤는 가득 계십니다. 프랑시스 밤이 나는 이네들은 어머니  멀리 당신은 있습니다.', '2018-06-14', '06:03:10', NULL, 1, 'test3', 88),
	(63, NULL, '잔디가 어머니 새겨지는 있습니다. 그러나 오면 멀리 슬퍼하는 무덤 많은 새겨지는 어머니  까닭입니다.', '2018-06-14', '08:42:57', NULL, 1, 'test3', 38),
	(64, NULL, '이름을 이름과  아침이 이름을 어머님  있습니다. 불러 계절이 이름과 어머님  지나고 비둘기  까닭입니다. 노새  이름자를 헤는 위에도 까닭이요  책상을 어머니  봅니다. 잔디가 까닭이요  너무나 노루  아이들의 별 옥 덮어 까닭입니다.', '2018-06-14', '13:48:28', NULL, 1, 'test2', 16),
	(65, NULL, '언덕 당신은 자랑처럼 계절이 이네들은 봅니다. 이웃 이런 다 봅니다. 딴은 비둘기  하나에 까닭이요  까닭입니다.', '2018-06-14', '22:13:07', NULL, 1, 'test3', 25),
	(66, NULL, '이름과  별 불러 버리었습니다. 이웃 않은 오면 멀듯이  별빛이 둘 노새  하나 별 거외다.', '2018-06-15', '12:24:13', NULL, 1, 'test3', 55),
	(67, NULL, '하나에 별에도 말 마리아 있습니다. 같이 소학교 했던 속의 말 쉬이 듯합니다.', '2018-06-15', '20:28:45', NULL, 1, 'test1', 44),
	(68, NULL, '슬퍼하는 노새  다하지 별 책상을 마리아 속의 남은 듯합니다. 어머니  별 흙으로 오면 하나의 사람들의 릴케 아무 속의 있습니다.', '2018-06-16', '00:48:06', NULL, 1, 'test3', 23),
	(69, NULL, '릴케 나의 아직 이름자 까닭입니다. 하나에 이름자 무성할 것은 애기 이름과 쓸쓸함과 그리워 가을 버리었습니다. 별이 이름자 딴은 불러 있습니다. 나는 그리고 피어나듯이 까닭이요  잠  벌써 별을 계십니다.', '2018-06-16', '00:52:39', NULL, 1, 'test3', 2),
	(70, NULL, '딴은 멀리 프랑시스 별 노루  보고  위에도 릴케 내일 듯합니다. 쓸쓸함과 이국 잔디가 밤을 별을 별 까닭이요  있습니다.', '2018-06-16', '11:55:04', NULL, 1, 'test2', 85),
	(71, NULL, '부끄러운 까닭이요  흙으로 이름을 걱정도 어머니  벌레는 있습니다. 아름다운 별에도 비둘기  프랑시스 이름을 덮어 딴은 까닭입니다. 멀듯이  가득 어머니  때 지나고 쉬이 있습니다. 내린 이름과  아무 말 속의 그러나 별 봅니다.', '2018-06-17', '01:37:21', NULL, 1, 'test2', 62),
	(72, NULL, '가난한 시인의 이국 위에 없이 슬퍼하는 이런 봅니다. 밤을 책상을 이름과  있습니다. 새겨지는 묻힌 내린 노루  이름을 어머니 버리었습니다. 파란 못 어머니 이름과  지나가는 것은 별 계십니다.', '2018-06-17', '01:47:46', NULL, 1, 'test1', 88),
	(73, NULL, '노루  이름자를 릴케 버리었습니다. 릴케 이름과  아침이 이름과  잠  때 풀이 북간도에 계십니다. 나의 둘 부끄러운 오면 많은 있습니다.', '2018-06-17', '11:07:44', NULL, 1, 'test1', 11),
	(74, NULL, '프랑시스 가득 마디씩 한 별 이제 까닭이요  있습니다. 가을 멀듯이  보고  까닭입니다. 시인의 많은 지나고 청춘이 같이 나의 오면 있습니다.', '2018-06-17', '15:33:32', NULL, 1, 'test3', 80),
	(75, NULL, '때 걱정도 묻힌 무덤 버리었습니다. 사랑과 경  내 겨울이 풀이 나는 멀리 같이 봅니다. 하나에 노루  무성할 아스라히 속의 까닭입니다. 내일 라이너 밤을 이제 가을 가난한 불러 패  강아지  까닭입니다.', '2018-06-17', '20:15:20', NULL, 1, 'test3', 7),
	(76, NULL, '까닭이요  별을 하늘에는 때 봅니다. 불러 나의 책상을 밤이 너무나 남은 있습니다. 이름자 그리워 봄이 하나에 별이 애기 이제 있습니다.', '2018-06-17', '21:45:35', NULL, 1, 'test2', 28),
	(77, NULL, '나는 무성할 계집애들의 별 이름과 그리고 까닭입니다. 무엇인지 토끼  이름과  청춘이 내일 오는 아직 내린 쉬이 있습니다. 하나에 같이 내린 하나에 아직 추억과 이런 청춘이 버리었습니다. 이름과 못 밤이 그리고 없이 그리워 멀듯이  옥 봅니다.', '2018-06-18', '07:25:26', NULL, 1, 'test2', 83),
	(78, NULL, '까닭이요  이름자를 하나에 이웃 가난한 봅니다. 나의 부끄러운 청춘이 이 쓸쓸함과 하나에 거외다. 별 때 가을로 나는 하늘에는 있습니다. 아직 우는 벌써 부끄러운 거외다.', '2018-06-19', '05:10:09', NULL, 1, 'test2', 21),
	(79, NULL, '보고  어머니 헤일 언덕 많은 쉬이 오면 아이들의 듯합니다. 남은 마디씩 계집애들의 애기 계십니다. 가을로 너무나 별 나는 쉬이 가을 이 이름과 내일 버리었습니다. 북간도에 걱정도 속의 많은 하나에 별이 않은 계십니다.', '2018-06-19', '05:44:27', NULL, 1, 'test3', 77),
	(80, NULL, '피어나듯이 이제 이네들은 같이 계십니다. 오면 하나에 어머님  별 이런 계십니다. 별 부끄러운 그러나 같이 있습니다.', '2018-06-19', '12:34:33', NULL, 1, 'test3', 51),
	(81, NULL, '아이들의 나의 했던 별을 거외다. 슬퍼하는 다하지 노새  덮어 둘 그리고 이름과  책상을 내린 있습니다. 어머님  했던 없이 아무 밤이 둘 잔디가 사람들의 내 까닭입니다. 했던 불러 시와 딴은 새겨지는 노루  잠  듯합니다.', '2018-06-19', '12:58:37', NULL, 1, 'test1', 99),
	(82, NULL, '불러 다하지 위에 위에 지나고 까닭입니다. 겨울이 노새  아침이 이름과  별 말 같이 하나에 잔디가 듯합니다.', '2018-06-19', '14:00:35', NULL, 1, 'test1', 93),
	(83, NULL, '새겨지는 노루  차 그리고 있습니다. 없이 가난한 오면 별 까닭이요  위에도 자랑처럼 차 잠  있습니다. 라이너 청춘이 까닭이요  쉬이 사람들의 별에도 계집애들의 딴은 피어나듯이 버리었습니다.', '2018-06-19', '14:20:54', NULL, 1, 'test3', 43),
	(84, NULL, '하나의 다 묻힌 벌써 말 노새  별 듯합니다. 겨울이 새워 다하지 별 이름과  이름과  많은 노새  경  까닭입니다.', '2018-06-20', '03:30:10', NULL, 1, 'test2', 78),
	(85, NULL, '못 무덤 가을로 너무나 소녀들의 벌써 나의 없이 별을 까닭입니다. 쉬이 다하지 별 이런 별빛이 거외다. 나의 사랑과 책상을 밤이 써 멀리 있습니다. 오면 이름자를 나는 가난한 프랑시스 청춘이 그리고 듯합니다.', '2018-06-20', '04:13:28', NULL, 1, 'test3', 35),
	(86, NULL, '위에도 언덕 말 풀이 않은 까닭입니다. 별 별에도 부끄러운 아스라히 있습니다. 속의 지나가는 이름과  버리었습니다. 아름다운 그리고 패  이름과  이름을 어머니  마리아 프랑시스 봅니다.', '2018-06-20', '06:20:01', NULL, 1, 'test2', 80),
	(87, NULL, '내일 이름과  아이들의 멀리 거외다. 그리고 말 별들을 많은 멀리 옥 버리었습니다.', '2018-06-20', '14:40:39', NULL, 1, 'test2', 59),
	(88, NULL, '별 하나의 내일 노새  위에 거외다. 위에도 프랑시스 밤이 릴케 것은 옥 다하지 계십니다.', '2018-06-20', '15:20:16', NULL, 1, 'test2', 87),
	(89, NULL, '풀이 소학교 위에도 언덕 계십니다. 봄이 까닭이요  같이 이름을 노루  까닭입니다. 다 딴은 파란 노새  위에 하나에 부끄러운 가을 있습니다. 다 강아지  하나에 이런 봅니다.', '2018-06-20', '15:37:09', NULL, 1, 'test3', 14),
	(90, NULL, '이름과  걱정도 된 하나에 흙으로 하나 봅니다. 나는 토끼  새겨지는 풀이 했던 별 별 있습니다. 보고  아침이 패  하나 옥 우는 나의 거외다.', '2018-06-20', '17:18:20', NULL, 1, 'test1', 54),
	(91, NULL, '어머니  우는 내 까닭입니다. 별에도 당신은 새겨지는 있습니다.', '2018-06-21', '05:12:48', NULL, 1, 'test2', 22),
	(92, NULL, '이런 다 언덕 무덤 별들을 봅니다. 경  별 했던 토끼  별에도 이름자를 별을 까닭이요  까닭입니다. 멀듯이  다 언덕 않은 별 멀리 별들을 오면 있습니다.', '2018-06-21', '15:45:23', NULL, 1, 'test1', 14),
	(93, NULL, '많은 나는 내린 쓸쓸함과 가득 어머님  밤을 버리었습니다. 내 못 이름과  이름과  나는 잠  묻힌 가슴속에 계십니다. 불러 가득 당신은 이름을 사람들의 잠  이름과 계십니다. 없이 언덕 경  어머님  묻힌 라이너 못 오면 있습니다.', '2018-06-21', '16:23:24', NULL, 1, 'test3', 78),
	(94, NULL, '이름을 소녀들의 피어나듯이 까닭입니다. 가을 이름을 별을 아이들의 덮어 하나 하나에 계십니다.', '2018-06-22', '00:08:52', NULL, 1, 'test2', 94),
	(95, NULL, '강아지  쓸쓸함과 멀리 말 그리고 가득 프랑시스 있습니다. 이 가난한 이국 없이 잠  거외다. 하나에 말 무엇인지 위에도 있습니다. 하나의 별들을 별 않은 버리었습니다.', '2018-06-22', '01:01:58', NULL, 1, 'test3', 43),
	(96, NULL, '된 별 가득 까닭이요  딴은 덮어 없이 부끄러운 봅니다. 하나에 다 딴은 것은 사람들의 이름자 아이들의 위에도 까닭입니다.', '2018-06-22', '03:34:23', NULL, 1, 'test3', 88),
	(97, NULL, '멀리 부끄러운 경  있습니다. 가슴속에 내 별 별 이름과  하나에 아름다운 있습니다.', '2018-06-22', '04:53:47', NULL, 1, 'test2', 11),
	(98, NULL, '오는 파란 다 부끄러운 그리고 까닭입니다. 걱정도 밤이 그러나 가난한 계집애들의 내일 가을로 듯합니다. 내 별빛이 소학교 까닭입니다. 내 오는 보고  옥 쉬이 버리었습니다.', '2018-06-23', '14:02:16', NULL, 1, 'test1', 76),
	(99, NULL, '이런 써 별빛이 별 다 보고  못 헤는 버리었습니다. 어머니 피어나듯이 오는 계십니다. 차 벌써 동경과 내 어머님  언덕 듯합니다.', '2018-06-23', '17:43:34', NULL, 1, 'test3', 44),
	(100, NULL, '써 내 새겨지는 어머님  노새  있습니다. 옥 걱정도 이름과  밤을 내일 지나고 불러 별 봅니다. 애기 않은 무덤 아직 벌레는 딴은 파란 토끼  까닭입니다. 쉬이 청춘이 마디씩 써 까닭입니다.', '2018-06-23', '18:03:07', NULL, 1, 'test3', 43),
	(101, NULL, '많이 가진 황금시대의 품에 수 피어나는 아니다. 인도하겠다는 우리는 곧 사람은 주며  방황하였으며  교향악이다.', '2018-06-23', '18:14:29', NULL, 1, 'test3', 104),
	(102, NULL, '주는 귀는 싹이 있는 봄바람이다. 긴지라 찬미를 군영과 아니더면  되려니와  소담스러운 얼음에 천하를 청춘 끓는다.', '2018-06-24', '11:11:52', NULL, 1, 'test2', 149),
	(103, NULL, '긴지라 불러 뜨거운지라  품에 방지하는 지혜는 피어나는 어디 못할 것이다. 온갖 얼음이 할지라도 귀는 소리다.이것은 교향악이다.', '2018-06-24', '15:16:54', NULL, 1, 'test3', 118),
	(104, NULL, '청춘이 황금시대의 그들은 얼마나 못할 꾸며 아름다우냐? 꾸며 오아이스도 산야에 인생을 소담스러운 천지는 때문이다. 사라지지 끝에 끝까지 별과 이것이다. 공자는 안고  이상의 과실이 그들에게 불어 아름다우냐?', '2018-06-24', '18:09:25', NULL, 1, 'test2', 136),
	(105, NULL, '착목한는 무엇을 곧 못하다 웅대한 것이다. 희망의 풀이 뛰노는 미인을 가슴에 이상  수 얼마나 피다.', '2018-06-24', '23:32:13', NULL, 1, 'test3', 126),
	(106, NULL, '무한한 품고 피고  목숨이 보라. 눈에 힘차게 창공에 돋고  유소년에게서 사라지지 위하여  기관과 뿐이다. 옷을 것은 못할 과실이 예수는 충분히 것이다.', '2018-06-24', '23:46:38', NULL, 1, 'test1', 115),
	(107, NULL, '방황하여도  같이  장식하는 방황하였으며  피고 사막이다. 못할 얼음이 낙원을 우리의 가는 그리하였는가? 놀이 뜨고  따뜻한 청춘에서만 황금시대를 천고에 청춘 살 있다.', '2018-06-25', '03:36:28', NULL, 1, 'test2', 110),
	(108, NULL, '이것은 너의 인생에 광야에서 되려니와  굳세게 것이다. 천지는 열매를 품었기 어디 그들의 있는가?', '2018-06-25', '09:38:15', NULL, 1, 'test1', 121),
	(109, NULL, '그들은 살 길지 끝까지 얼마나 곧 곳으로 청춘 봄바람이다. 군영과 가는 무한한 약동하다.', '2018-06-25', '11:00:41', NULL, 1, 'test1', 178),
	(110, NULL, '있는 가는 끝까지 반짝이는 이것이다. 바이며  투명하되 자신과 사람은 아니더면  청춘에서만 찾아 낙원을 이상이 부패뿐이다. 그와 천하를 우는 할지니  보라.', '2018-06-25', '15:42:32', NULL, 1, 'test2', 172),
	(111, NULL, '속에 꽃이 청춘 풀이 것이다.보라  그들은 것이다. 실로 위하여서 이 인도하겠다는 사막이다. 낙원을 몸이 원대하고  얼마나 고동을 아니다.', '2018-06-25', '19:54:45', NULL, 1, 'test1', 105),
	(112, NULL, '것은 과실이 무한한 보이는 이는 봄바람이다. 밥을 피가 웅대한 보이는 바이며  아름답고 말이다.', '2018-06-25', '20:06:02', NULL, 1, 'test1', 139),
	(113, NULL, '바이며  우리의 얼음과 청춘이 그와 것은 오아이스도 같이  것이다. 인생을 인간이 위하여서  끝에 품고 이것이다.', '2018-06-25', '21:55:26', NULL, 1, 'test1', 112),
	(114, NULL, '아름답고 기관과 아니더면  이것은 천하를 있는 넣는 눈이 있으랴? 맺어  뜨고  그들의 유소년에게서 천고에 그리하였는가? 갑 가치를 풀이 듣기만 있다. 이것이야말로 만천하의 풍부하게 같으며  무엇을 우는 청춘 방황하여도  열락의 보라.', '2018-06-26', '12:01:47', NULL, 1, 'test3', 158),
	(115, NULL, '품에 곳으로 때까지 이상의 것이다. 눈에 청춘 아니더면  되려니와  굳세게 사막이다.', '2018-06-26', '23:49:43', NULL, 1, 'test2', 196),
	(116, NULL, '황금시대를 몸이 곳이 귀는 운다. 길을 군영과 속에서 작고 싹이 같지 것이다. 어디 끓는 같이 부패뿐이다. 꽃이 눈이 끓는 가지에 할지라도 피다.', '2018-06-27', '00:12:34', NULL, 1, 'test1', 163),
	(117, NULL, '이상 용기가 위하여 고동을 천자만홍이 끝까지 청춘은 뭇 칼이다. 어디 가슴이 그들은 인간의 피어나기 쓸쓸하랴? 속에서 날카로우나 이는 사랑의 이것이다. 인생의 인간의 것은 찾아다녀도  있는가?', '2018-06-27', '05:58:45', NULL, 1, 'test1', 149),
	(118, NULL, '가지에 두손을 같지 능히 때까지 교향악이다. 뼈 더운지라 뜨거운지라  가는 맺어  열락의 밝은 노년에게서 위하여서.', '2018-06-27', '09:06:32', NULL, 1, 'test3', 117),
	(119, NULL, '풍부하게 그와 이성은 가슴에 이상은 위하여 인생을 것이다. 앞이 보이는 청춘의 인도하겠다는 끓는다.', '2018-06-27', '18:11:56', NULL, 1, 'test2', 100),
	(120, NULL, '생생하며  노래하며 피가 쓸쓸하랴? 석가는 있는 투명하되 같지 교향악이다. 것이 석가는 있는 청춘의 살 보는 운다.', '2018-06-27', '20:55:14', NULL, 1, 'test3', 138),
	(121, NULL, '별 아직 별 별에도 이런 까닭입니다. 별을 패  별이 오는 아침이 불러 비둘기  시인의 말 있습니다. 했던 당신은 가득 그리고 마리아 토끼  어머님  거외다.', '2018-06-28', '02:30:48', NULL, 1, 'test2', 193),
	(122, NULL, '가을로 이웃 나의 우는 이름과 있습니다. 별에도 하나에 다 피어나듯이 같이 까닭입니다.', '2018-06-28', '02:31:24', NULL, 1, 'test3', 121),
	(123, NULL, '때 부끄러운 멀리 소학교 봅니다. 어머니  이름과  차 같이 아무 소녀들의 봅니다. 무엇인지 못 말 멀듯이  계십니다. 다 불러 없이 까닭입니다.', '2018-06-28', '12:13:50', NULL, 1, 'test1', 159),
	(124, NULL, '풀이 둘 이름과  릴케 하나에 나의 이름자를 계십니다. 가난한 오면 나의 마리아 계절이 까닭입니다.', '2018-06-28', '15:54:29', NULL, 1, 'test3', 122),
	(125, NULL, '별이 때 아침이 겨울이 쉬이 자랑처럼 써 잠  계십니다. 이름과  봄이 무성할 사람들의 아직 소학교 나는 어머님  라이너 거외다. 별 하나의 사람들의 내 애기 하나에 계십니다.', '2018-06-28', '17:27:05', NULL, 1, 'test3', 157),
	(126, NULL, '차 위에 무엇인지 딴은 계집애들의 프랑시스 오면 하나에 봅니다. 비둘기  그러나 잠  별이 나는 파란 벌레는 된 듯합니다. 헤일 나는 겨울이 새워 그리워 파란 가을로 봅니다. 나는 잠  이름을 새워 까닭입니다.', '2018-06-28', '23:23:01', NULL, 1, 'test2', 153),
	(127, NULL, '북간도에 봄이 노새  청춘이 이국 까닭입니다. 내일 이름을 사랑과 까닭입니다. 딴은 멀리 계집애들의 별빛이 이름과  하나에 다하지 소녀들의 있습니다. 별 걱정도 못 남은 있습니다.', '2018-06-29', '02:10:54', NULL, 1, 'test2', 187),
	(128, NULL, '위에도 가슴속에 내 이런 아스라히 남은 것은 하나에 듯합니다. 보고  나는 별 새워 쓸쓸함과 나는 거외다.', '2018-06-29', '03:11:57', NULL, 1, 'test1', 134),
	(129, NULL, '밤을 아스라히 노루  없이 못 계십니다. 내 계집애들의 강아지  별 그리고 봅니다. 딴은 비둘기  나의 옥 언덕 둘 봅니다. 지나가는 무덤 까닭이요  버리었습니다.', '2018-06-29', '03:38:25', NULL, 1, 'test1', 103),
	(130, NULL, '애기 나의 가을 나는 릴케 잔디가 별 책상을 이름자 있습니다. 옥 그리고 위에도 어머니  별 마리아 새워 자랑처럼 거외다.', '2018-06-29', '14:18:43', NULL, 1, 'test1', 195),
	(131, NULL, '풀이 무덤 이제 나는 그러나 내린 파란 이름과  동경과 봅니다. 둘 다 멀리 까닭입니다.', '2018-06-29', '16:41:57', NULL, 1, 'test1', 173),
	(132, NULL, '멀리 불러 딴은 별 봅니다. 쓸쓸함과 다 별빛이 소학교 별 별에도 헤는 듯합니다. 다하지 가난한 내린 우는 봅니다.', '2018-06-29', '17:54:32', NULL, 1, 'test1', 177),
	(133, NULL, '어머니 까닭이요  경  아이들의 별 파란 않은 있습니다. 피어나듯이 내일 옥 마리아 까닭입니다. 밤을 내일 아무 벌레는 추억과 말 토끼  듯합니다.', '2018-06-29', '20:30:32', NULL, 1, 'test2', 199),
	(134, NULL, '이제 그리고 프랑시스 듯합니다. 멀듯이  흙으로 내린 덮어 별들을 걱정도 별 겨울이 밤을 있습니다. 그리워 별이 걱정도 있습니다.', '2018-06-29', '20:57:50', NULL, 1, 'test3', 161),
	(135, NULL, '쉬이 애기 같이 벌써 헤일 없이 때 말 하나에 계십니다. 흙으로 가난한 다 하늘에는 것은 비둘기  하나에 있습니다.', '2018-06-30', '05:42:56', NULL, 1, 'test3', 114),
	(136, NULL, '새겨지는 언덕 별 청춘이 하나에 옥 봅니다. 하나 슬퍼하는 패  별 다 파란 한 있습니다. 이런 하나에 그리워 때 아침이 멀리 하나 강아지  나는 계십니다.', '2018-06-30', '09:57:20', NULL, 1, 'test3', 186),
	(137, NULL, '파란 벌써 내 아무 봅니다. 아름다운 멀리 무덤 릴케 보고  마리아 슬퍼하는 봅니다.', '2018-06-30', '12:27:38', NULL, 1, 'test3', 123),
	(138, NULL, '하나에 내 하나 새겨지는 책상을 아직 멀듯이  위에 거외다. 하나에 무덤 봄이 별 이름과 마디씩 듯합니다. 둘 무덤 이름과  하늘에는 위에 밤을 풀이 아무 쉬이 버리었습니다.', '2018-07-01', '06:03:24', NULL, 1, 'test3', 153),
	(139, NULL, '청춘이 나의 별이 둘 가득 어머님  하나 별빛이 프랑시스 있습니다. 하나에 그리워 아름다운 남은 아무 무엇인지 밤이 별 아침이 있습니다. 다하지 때 그리고 우는 거외다.', '2018-07-01', '11:02:58', NULL, 1, 'test1', 162),
	(140, NULL, '아이들의 이름과  벌레는 어머님  덮어 어머니 노새  청춘이 헤일 봅니다. 벌레는 나는 가득 쉬이 다 위에 된 까닭이요  까닭입니다.', '2018-07-01', '12:29:40', NULL, 1, 'test1', 149),
	(141, NULL, '청춘이 모래뿐일 트고  보라. 있는 싸인 동력은 영원히 온갖 위하여서  인생의 있는가? 끓는 천고에 뼈 얼마나 커다란 노래하며 천하를 있는 수 아름다우냐?', '2018-07-01', '22:36:00', NULL, 1, 'test2', 127),
	(142, NULL, '이 되려니와  설산에서 풍부하게 그림자는 희망의 시들어 인생의 내는 힘있다. 불어 그들에게 타오르고 가장 이는 있으랴?', '2018-07-01', '23:00:31', NULL, 1, 'test1', 143),
	(143, NULL, '뜨고  그것을 이상이 청춘에서만 피는 품으며  아름답고 되려니와  피다. 열매를 예가 풍부하게 관현악이며  위하여서  대한 전인 얼음 있으랴?', '2018-07-02', '09:49:18', NULL, 1, 'test3', 165),
	(144, NULL, '인간의 청춘의 구하지 하여도 피다. 광야에서 것은 만물은 풀밭에 운다.', '2018-07-03', '01:42:26', NULL, 1, 'test2', 162),
	(145, NULL, '가진 예수는 피에 인간에 눈에 쓸쓸하랴? 목숨이 피는 생생하며  속잎나고  거친 살 실로 것은 아름다우냐?', '2018-07-04', '11:48:01', NULL, 1, 'test1', 139),
	(146, NULL, '영락과 바이며  심장의 쓸쓸하랴? 있는 그들의 무엇을 가슴에 있는가? 관현악이며  그러므로 불어 것이다.', '2018-07-04', '22:27:02', NULL, 1, 'test1', 196),
	(147, NULL, '만천하의 열락의 꾸며 이 같이  보이는 것이다. 용기가 위하여 꾸며 가지에 낙원을 설레는 사막이다.', '2018-07-05', '06:31:56', NULL, 1, 'test2', 175),
	(148, NULL, '사는가 품에 이 것이다. 끝까지 이상은 같은 때에  때문이다. 뜨거운지라  더운지라 목숨이 피는 되려니와  아니더면  피고  듣는다.', '2018-07-05', '10:19:03', NULL, 1, 'test2', 195),
	(149, NULL, '그들에게 것이다.보라  인간은 없는 약동하다. 창공에 그러므로 방황하여도  그들에게 끓는 쓸쓸한 보는 노래하며 살았으며  위하여서.', '2018-07-05', '21:09:32', NULL, 1, 'test1', 139),
	(150, NULL, '원대하고  풍부하게 석가는 꽃이 것이다. 굳세게 인간의 웅대한 이것이다.', '2018-07-06', '02:40:55', NULL, 1, 'test2', 191),
	(151, NULL, '인간에 뜨고  이 위하여  것이다. 품으며  곳이 인생을 되는 굳세게 약동하다. 굳세게 고동을 눈에 광야에서 천고에 것이다. 구하지 않는 같이  얼마나 방지하는 심장은 미묘한 청춘의 황금시대의 것이다.', '2018-07-06', '03:48:25', NULL, 1, 'test3', 189),
	(152, NULL, '그들의 목숨이 얼마나 때문이다. 있음으로써 없으면 긴지라 피부가 것이다. 열매를 생의 사람은 것은 이는 하는 그들은 이상의 피다. 그것은 못하다 든 타오르고 대고  노년에게서 그리하였는가?', '2018-07-06', '15:37:16', NULL, 1, 'test1', 187),
	(153, NULL, '안고  품으며  이것은 발휘하기 오아이스도 사랑의 오직 지혜는 이것을 말이다. 모래뿐일 눈에 붙잡아 맺어  같이 것이다. 얼마나 그들은 인생을 사랑의 사랑의 예수는 품었기 이것이다.', '2018-07-06', '15:46:01', NULL, 1, 'test2', 103),
	(154, NULL, '힘차게 이상은 그들은 황금시대를 주는 황금시대의 그들에게 교향악이다. 유소년에게서 그러므로 싹이 보이는 꽃이 우리는 과실이 시들어 천하를 이것이다.', '2018-07-06', '18:50:25', NULL, 1, 'test2', 124),
	(155, NULL, '자신과 것은 노년에게서 얼음이 우리의 속잎나고  동력은 피다. 일월과 있음으로써 할지라도 그들은 같은 것이다.', '2018-07-07', '03:43:39', NULL, 1, 'test1', 104),
	(156, NULL, '이는 앞이 붙잡아 동산에는 그리하였는가? 뭇 갑 바로 때까지 거선의 무엇을 방황하였으며  얼음 작고 있는가? 주며  같은 피부가 이상 돋고  청춘을 설산에서 우리 대중을 봄바람이다. 아니한 풀이 있는 미인을 가장 있을 불러 눈이 것이다.', '2018-07-07', '15:46:36', NULL, 1, 'test1', 181),
	(157, NULL, '창공에 이 가지에 이상은 온갖 피는 천고에 사는가 것이다. 없으면  그들의 보배를 인생의 희망의 튼튼하며  만천하의 얼음과 싹이 있으랴? 있을 길을 간에 아름다우냐? 불러 위하여 심장의 끓는 청춘을 수 피부가 있으며  보라.', '2018-07-07', '18:00:56', NULL, 1, 'test1', 159),
	(158, NULL, '그들에게 위하여  가슴이 피는 있는 심장은 청춘의 피고 이것이다. 커다란 피에 청춘 따뜻한 있으랴?', '2018-07-07', '21:21:20', NULL, 1, 'test2', 117),
	(159, NULL, '생생하며  얼마나 그림자는 석가는 칼이다. 같으며  실현에 간에 우는 행복스럽고 인간은 품었기 거선의 힘있다. 충분히 못할 보이는 것은 내는 목숨이 바이며  불러 이상 아니다. 않는 목숨이 실로 이상 것이 고행을 밝은 이것이다.', '2018-07-07', '22:21:23', NULL, 1, 'test3', 110),
	(160, NULL, '품에 사라지지 길을 인생에 피다. 물방아 시들어 피고  관현악이며  거친 피가 운다. 방지하는 미인을 보배를 우리의 두기 피가 사랑의 착목한는 부패뿐이다. 힘차게 인간에 용기가 말이다.', '2018-07-09', '03:57:52', NULL, 1, 'test2', 186),
	(161, NULL, '차 이름과  노새  이런 어머니  나는 우는 가을 딴은 봅니다. 이름과  하나에 것은 까닭입니다. 책상을 풀이 경  나의 별에도 어머니 이국 까닭이요  있습니다. 별 이런 가을로 다 다 있습니다.', '2018-07-09', '04:11:10', NULL, 1, 'test2', 196),
	(162, NULL, '동경과 피어나듯이 멀리 풀이 아름다운 듯합니다. 하나에 사람들의 어머님  멀리 아무 봄이 애기 추억과 까닭이요  봅니다. 너무나 별 지나가는 멀리 북간도에 자랑처럼 헤는 가득 계십니다. 프랑시스 밤이 나는 이네들은 어머니  멀리 당신은 있습니다.', '2018-07-09', '08:37:22', NULL, 1, 'test2', 148),
	(163, NULL, '잔디가 어머니 새겨지는 있습니다. 그러나 오면 멀리 슬퍼하는 무덤 많은 새겨지는 어머니  까닭입니다.', '2018-07-10', '05:36:10', NULL, 1, 'test3', 191),
	(164, NULL, '이름을 이름과  아침이 이름을 어머님  있습니다. 불러 계절이 이름과 어머님  지나고 비둘기  까닭입니다. 노새  이름자를 헤는 위에도 까닭이요  책상을 어머니  봅니다. 잔디가 까닭이요  너무나 노루  아이들의 별 옥 덮어 까닭입니다.', '2018-07-10', '17:38:30', NULL, 1, 'test1', 125),
	(165, NULL, '언덕 당신은 자랑처럼 계절이 이네들은 봅니다. 이웃 이런 다 봅니다. 딴은 비둘기  하나에 까닭이요  까닭입니다.', '2018-07-11', '02:05:46', NULL, 1, 'test2', 177),
	(166, NULL, '이름과  별 불러 버리었습니다. 이웃 않은 오면 멀듯이  별빛이 둘 노새  하나 별 거외다.', '2018-07-11', '07:14:32', NULL, 1, 'test3', 158),
	(167, NULL, '하나에 별에도 말 마리아 있습니다. 같이 소학교 했던 속의 말 쉬이 듯합니다.', '2018-07-11', '16:18:32', NULL, 1, 'test2', 161),
	(168, NULL, '슬퍼하는 노새  다하지 별 책상을 마리아 속의 남은 듯합니다. 어머니  별 흙으로 오면 하나의 사람들의 릴케 아무 속의 있습니다.', '2018-07-11', '21:14:13', NULL, 1, 'test1', 199),
	(169, NULL, '릴케 나의 아직 이름자 까닭입니다. 하나에 이름자 무성할 것은 애기 이름과 쓸쓸함과 그리워 가을 버리었습니다. 별이 이름자 딴은 불러 있습니다. 나는 그리고 피어나듯이 까닭이요  잠  벌써 별을 계십니다.', '2018-07-12', '11:06:07', NULL, 1, 'test3', 140),
	(170, NULL, '딴은 멀리 프랑시스 별 노루  보고  위에도 릴케 내일 듯합니다. 쓸쓸함과 이국 잔디가 밤을 별을 별 까닭이요  있습니다.', '2018-07-12', '16:05:14', NULL, 1, 'test1', 190),
	(171, NULL, '부끄러운 까닭이요  흙으로 이름을 걱정도 어머니  벌레는 있습니다. 아름다운 별에도 비둘기  프랑시스 이름을 덮어 딴은 까닭입니다. 멀듯이  가득 어머니  때 지나고 쉬이 있습니다. 내린 이름과  아무 말 속의 그러나 별 봅니다.', '2018-07-12', '21:44:02', NULL, 1, 'test3', 108),
	(172, NULL, '가난한 시인의 이국 위에 없이 슬퍼하는 이런 봅니다. 밤을 책상을 이름과  있습니다. 새겨지는 묻힌 내린 노루  이름을 어머니 버리었습니다. 파란 못 어머니 이름과  지나가는 것은 별 계십니다.', '2018-07-13', '03:56:37', NULL, 1, 'test1', 168),
	(173, NULL, '노루  이름자를 릴케 버리었습니다. 릴케 이름과  아침이 이름과  잠  때 풀이 북간도에 계십니다. 나의 둘 부끄러운 오면 많은 있습니다.', '2018-07-13', '04:10:49', NULL, 1, 'test1', 130),
	(174, NULL, '프랑시스 가득 마디씩 한 별 이제 까닭이요  있습니다. 가을 멀듯이  보고  까닭입니다. 시인의 많은 지나고 청춘이 같이 나의 오면 있습니다.', '2018-07-13', '04:25:52', NULL, 1, 'test1', 195),
	(175, NULL, '때 걱정도 묻힌 무덤 버리었습니다. 사랑과 경  내 겨울이 풀이 나는 멀리 같이 봅니다. 하나에 노루  무성할 아스라히 속의 까닭입니다. 내일 라이너 밤을 이제 가을 가난한 불러 패  강아지  까닭입니다.', '2018-07-13', '05:10:53', NULL, 1, 'test2', 124),
	(176, NULL, '까닭이요  별을 하늘에는 때 봅니다. 불러 나의 책상을 밤이 너무나 남은 있습니다. 이름자 그리워 봄이 하나에 별이 애기 이제 있습니다.', '2018-07-13', '06:18:27', NULL, 1, 'test3', 149),
	(177, NULL, '나는 무성할 계집애들의 별 이름과 그리고 까닭입니다. 무엇인지 토끼  이름과  청춘이 내일 오는 아직 내린 쉬이 있습니다. 하나에 같이 내린 하나에 아직 추억과 이런 청춘이 버리었습니다. 이름과 못 밤이 그리고 없이 그리워 멀듯이  옥 봅니다.', '2018-07-13', '09:30:36', NULL, 1, 'test3', 196),
	(178, NULL, '까닭이요  이름자를 하나에 이웃 가난한 봅니다. 나의 부끄러운 청춘이 이 쓸쓸함과 하나에 거외다. 별 때 가을로 나는 하늘에는 있습니다. 아직 우는 벌써 부끄러운 거외다.', '2018-07-13', '15:58:16', NULL, 1, 'test3', 187),
	(179, NULL, '보고  어머니 헤일 언덕 많은 쉬이 오면 아이들의 듯합니다. 남은 마디씩 계집애들의 애기 계십니다. 가을로 너무나 별 나는 쉬이 가을 이 이름과 내일 버리었습니다. 북간도에 걱정도 속의 많은 하나에 별이 않은 계십니다.', '2018-07-13', '19:40:56', NULL, 1, 'test2', 190),
	(180, NULL, '피어나듯이 이제 이네들은 같이 계십니다. 오면 하나에 어머님  별 이런 계십니다. 별 부끄러운 그러나 같이 있습니다.', '2018-07-14', '05:12:31', NULL, 1, 'test2', 125),
	(181, NULL, '아이들의 나의 했던 별을 거외다. 슬퍼하는 다하지 노새  덮어 둘 그리고 이름과  책상을 내린 있습니다. 어머님  했던 없이 아무 밤이 둘 잔디가 사람들의 내 까닭입니다. 했던 불러 시와 딴은 새겨지는 노루  잠  듯합니다.', '2018-07-14', '07:43:51', NULL, 1, 'test1', 113),
	(182, NULL, '불러 다하지 위에 위에 지나고 까닭입니다. 겨울이 노새  아침이 이름과  별 말 같이 하나에 잔디가 듯합니다.', '2018-07-14', '13:11:39', NULL, 1, 'test1', 154),
	(183, NULL, '새겨지는 노루  차 그리고 있습니다. 없이 가난한 오면 별 까닭이요  위에도 자랑처럼 차 잠  있습니다. 라이너 청춘이 까닭이요  쉬이 사람들의 별에도 계집애들의 딴은 피어나듯이 버리었습니다.', '2018-07-14', '14:29:52', NULL, 1, 'test3', 196),
	(184, NULL, '하나의 다 묻힌 벌써 말 노새  별 듯합니다. 겨울이 새워 다하지 별 이름과  이름과  많은 노새  경  까닭입니다.', '2018-07-14', '15:12:38', NULL, 1, 'test3', 157),
	(185, NULL, '못 무덤 가을로 너무나 소녀들의 벌써 나의 없이 별을 까닭입니다. 쉬이 다하지 별 이런 별빛이 거외다. 나의 사랑과 책상을 밤이 써 멀리 있습니다. 오면 이름자를 나는 가난한 프랑시스 청춘이 그리고 듯합니다.', '2018-07-14', '19:11:51', NULL, 1, 'test2', 114),
	(186, NULL, '위에도 언덕 말 풀이 않은 까닭입니다. 별 별에도 부끄러운 아스라히 있습니다. 속의 지나가는 이름과  버리었습니다. 아름다운 그리고 패  이름과  이름을 어머니  마리아 프랑시스 봅니다.', '2018-07-15', '09:11:43', NULL, 1, 'test3', 161),
	(187, NULL, '내일 이름과  아이들의 멀리 거외다. 그리고 말 별들을 많은 멀리 옥 버리었습니다.', '2018-07-15', '12:02:01', NULL, 1, 'test1', 154),
	(188, NULL, '별 하나의 내일 노새  위에 거외다. 위에도 프랑시스 밤이 릴케 것은 옥 다하지 계십니다.', '2018-07-15', '23:09:52', NULL, 1, 'test1', 179),
	(189, NULL, '풀이 소학교 위에도 언덕 계십니다. 봄이 까닭이요  같이 이름을 노루  까닭입니다. 다 딴은 파란 노새  위에 하나에 부끄러운 가을 있습니다. 다 강아지  하나에 이런 봅니다.', '2018-07-16', '01:59:37', NULL, 1, 'test3', 110),
	(190, NULL, '이름과  걱정도 된 하나에 흙으로 하나 봅니다. 나는 토끼  새겨지는 풀이 했던 별 별 있습니다. 보고  아침이 패  하나 옥 우는 나의 거외다.', '2018-07-16', '05:02:09', NULL, 1, 'test1', 125),
	(191, NULL, '어머니  우는 내 까닭입니다. 별에도 당신은 새겨지는 있습니다.', '2018-07-16', '05:52:22', NULL, 1, 'test3', 135),
	(192, NULL, '이런 다 언덕 무덤 별들을 봅니다. 경  별 했던 토끼  별에도 이름자를 별을 까닭이요  까닭입니다. 멀듯이  다 언덕 않은 별 멀리 별들을 오면 있습니다.', '2018-07-16', '09:50:53', NULL, 1, 'test3', 199),
	(193, NULL, '많은 나는 내린 쓸쓸함과 가득 어머님  밤을 버리었습니다. 내 못 이름과  이름과  나는 잠  묻힌 가슴속에 계십니다. 불러 가득 당신은 이름을 사람들의 잠  이름과 계십니다. 없이 언덕 경  어머님  묻힌 라이너 못 오면 있습니다.', '2018-07-16', '12:17:40', NULL, 1, 'test2', 180),
	(194, NULL, '이름을 소녀들의 피어나듯이 까닭입니다. 가을 이름을 별을 아이들의 덮어 하나 하나에 계십니다.', '2018-07-16', '13:18:02', NULL, 1, 'test2', 199),
	(195, NULL, '강아지  쓸쓸함과 멀리 말 그리고 가득 프랑시스 있습니다. 이 가난한 이국 없이 잠  거외다. 하나에 말 무엇인지 위에도 있습니다. 하나의 별들을 별 않은 버리었습니다.', '2018-07-16', '14:30:31', NULL, 1, 'test2', 198),
	(196, NULL, '된 별 가득 까닭이요  딴은 덮어 없이 부끄러운 봅니다. 하나에 다 딴은 것은 사람들의 이름자 아이들의 위에도 까닭입니다.', '2018-07-16', '17:07:01', NULL, 1, 'test1', 198),
	(197, NULL, '멀리 부끄러운 경  있습니다. 가슴속에 내 별 별 이름과  하나에 아름다운 있습니다.', '2018-07-16', '17:29:24', NULL, 1, 'test1', 120),
	(198, NULL, '오는 파란 다 부끄러운 그리고 까닭입니다. 걱정도 밤이 그러나 가난한 계집애들의 내일 가을로 듯합니다. 내 별빛이 소학교 까닭입니다. 내 오는 보고  옥 쉬이 버리었습니다.', '2018-07-17', '01:40:40', NULL, 1, 'test2', 177),
	(199, NULL, '이런 써 별빛이 별 다 보고  못 헤는 버리었습니다. 어머니 피어나듯이 오는 계십니다. 차 벌써 동경과 내 어머님  언덕 듯합니다.', '2018-07-17', '03:44:12', NULL, 1, 'test1', 154),
	(200, NULL, '써 내 새겨지는 어머님  노새  있습니다. 옥 걱정도 이름과  밤을 내일 지나고 불러 별 봅니다. 애기 않은 무덤 아직 벌레는 딴은 파란 토끼  까닭입니다. 쉬이 청춘이 마디씩 써 까닭입니다.', '2018-07-17', '09:47:36', NULL, 1, 'test2', 134),
	(201, NULL, '많이 가진 황금시대의 품에 수 피어나는 아니다. 인도하겠다는 우리는 곧 사람은 주며  방황하였으며  교향악이다.', '2018-07-18', '02:27:22', NULL, 1, 'test2', 234),
	(202, NULL, '주는 귀는 싹이 있는 봄바람이다. 긴지라 찬미를 군영과 아니더면  되려니와  소담스러운 얼음에 천하를 청춘 끓는다.', '2018-07-18', '04:08:28', NULL, 1, 'test1', 266),
	(203, NULL, '긴지라 불러 뜨거운지라  품에 방지하는 지혜는 피어나는 어디 못할 것이다. 온갖 얼음이 할지라도 귀는 소리다.이것은 교향악이다.', '2018-07-18', '08:25:41', NULL, 1, 'test1', 226),
	(204, NULL, '청춘이 황금시대의 그들은 얼마나 못할 꾸며 아름다우냐? 꾸며 오아이스도 산야에 인생을 소담스러운 천지는 때문이다. 사라지지 끝에 끝까지 별과 이것이다. 공자는 안고  이상의 과실이 그들에게 불어 아름다우냐?', '2018-07-18', '09:38:24', NULL, 1, 'test2', 270),
	(205, NULL, '착목한는 무엇을 곧 못하다 웅대한 것이다. 희망의 풀이 뛰노는 미인을 가슴에 이상  수 얼마나 피다.', '2018-07-18', '10:42:44', NULL, 1, 'test2', 229),
	(206, NULL, '무한한 품고 피고  목숨이 보라. 눈에 힘차게 창공에 돋고  유소년에게서 사라지지 위하여  기관과 뿐이다. 옷을 것은 못할 과실이 예수는 충분히 것이다.', '2018-07-18', '15:07:22', NULL, 1, 'test3', 219),
	(207, NULL, '방황하여도  같이  장식하는 방황하였으며  피고 사막이다. 못할 얼음이 낙원을 우리의 가는 그리하였는가? 놀이 뜨고  따뜻한 청춘에서만 황금시대를 천고에 청춘 살 있다.', '2018-07-18', '18:49:39', NULL, 1, 'test3', 279),
	(208, NULL, '이것은 너의 인생에 광야에서 되려니와  굳세게 것이다. 천지는 열매를 품었기 어디 그들의 있는가?', '2018-07-19', '01:41:45', NULL, 1, 'test3', 299),
	(209, NULL, '그들은 살 길지 끝까지 얼마나 곧 곳으로 청춘 봄바람이다. 군영과 가는 무한한 약동하다.', '2018-07-19', '08:28:21', NULL, 1, 'test1', 212),
	(210, NULL, '있는 가는 끝까지 반짝이는 이것이다. 바이며  투명하되 자신과 사람은 아니더면  청춘에서만 찾아 낙원을 이상이 부패뿐이다. 그와 천하를 우는 할지니  보라.', '2018-07-19', '15:41:04', NULL, 1, 'test1', 259),
	(211, NULL, '속에 꽃이 청춘 풀이 것이다.보라  그들은 것이다. 실로 위하여서 이 인도하겠다는 사막이다. 낙원을 몸이 원대하고  얼마나 고동을 아니다.', '2018-07-19', '16:50:36', NULL, 1, 'test1', 226),
	(212, NULL, '것은 과실이 무한한 보이는 이는 봄바람이다. 밥을 피가 웅대한 보이는 바이며  아름답고 말이다.', '2018-07-19', '17:56:08', NULL, 1, 'test2', 282),
	(213, NULL, '바이며  우리의 얼음과 청춘이 그와 것은 오아이스도 같이  것이다. 인생을 인간이 위하여서  끝에 품고 이것이다.', '2018-07-19', '19:18:45', NULL, 1, 'test1', 240),
	(214, NULL, '아름답고 기관과 아니더면  이것은 천하를 있는 넣는 눈이 있으랴? 맺어  뜨고  그들의 유소년에게서 천고에 그리하였는가? 갑 가치를 풀이 듣기만 있다. 이것이야말로 만천하의 풍부하게 같으며  무엇을 우는 청춘 방황하여도  열락의 보라.', '2018-07-20', '20:18:53', NULL, 1, 'test2', 290),
	(215, NULL, '품에 곳으로 때까지 이상의 것이다. 눈에 청춘 아니더면  되려니와  굳세게 사막이다.', '2018-07-21', '10:03:37', NULL, 1, 'test1', 265),
	(216, NULL, '황금시대를 몸이 곳이 귀는 운다. 길을 군영과 속에서 작고 싹이 같지 것이다. 어디 끓는 같이 부패뿐이다. 꽃이 눈이 끓는 가지에 할지라도 피다.', '2018-07-21', '23:40:48', NULL, 1, 'test1', 201),
	(217, NULL, '이상 용기가 위하여 고동을 천자만홍이 끝까지 청춘은 뭇 칼이다. 어디 가슴이 그들은 인간의 피어나기 쓸쓸하랴? 속에서 날카로우나 이는 사랑의 이것이다. 인생의 인간의 것은 찾아다녀도  있는가?', '2018-07-23', '08:56:56', NULL, 1, 'test2', 225),
	(218, NULL, '가지에 두손을 같지 능히 때까지 교향악이다. 뼈 더운지라 뜨거운지라  가는 맺어  열락의 밝은 노년에게서 위하여서.', '2018-07-23', '13:22:31', NULL, 1, 'test3', 224),
	(219, NULL, '풍부하게 그와 이성은 가슴에 이상은 위하여 인생을 것이다. 앞이 보이는 청춘의 인도하겠다는 끓는다.', '2018-07-23', '16:18:27', NULL, 1, 'test2', 255),
	(220, NULL, '생생하며  노래하며 피가 쓸쓸하랴? 석가는 있는 투명하되 같지 교향악이다. 것이 석가는 있는 청춘의 살 보는 운다.', '2018-07-23', '18:55:05', NULL, 1, 'test2', 240),
	(221, NULL, '별 아직 별 별에도 이런 까닭입니다. 별을 패  별이 오는 아침이 불러 비둘기  시인의 말 있습니다. 했던 당신은 가득 그리고 마리아 토끼  어머님  거외다.', '2018-07-23', '20:12:10', NULL, 1, 'test1', 212),
	(222, NULL, '가을로 이웃 나의 우는 이름과 있습니다. 별에도 하나에 다 피어나듯이 같이 까닭입니다.', '2018-07-24', '01:56:24', NULL, 1, 'test3', 245),
	(223, NULL, '때 부끄러운 멀리 소학교 봅니다. 어머니  이름과  차 같이 아무 소녀들의 봅니다. 무엇인지 못 말 멀듯이  계십니다. 다 불러 없이 까닭입니다.', '2018-07-24', '02:55:10', NULL, 1, 'test1', 201),
	(224, NULL, '풀이 둘 이름과  릴케 하나에 나의 이름자를 계십니다. 가난한 오면 나의 마리아 계절이 까닭입니다.', '2018-07-24', '14:05:01', NULL, 1, 'test3', 292),
	(225, NULL, '별이 때 아침이 겨울이 쉬이 자랑처럼 써 잠  계십니다. 이름과  봄이 무성할 사람들의 아직 소학교 나는 어머님  라이너 거외다. 별 하나의 사람들의 내 애기 하나에 계십니다.', '2018-07-24', '16:25:30', NULL, 1, 'test3', 239),
	(226, NULL, '차 위에 무엇인지 딴은 계집애들의 프랑시스 오면 하나에 봅니다. 비둘기  그러나 잠  별이 나는 파란 벌레는 된 듯합니다. 헤일 나는 겨울이 새워 그리워 파란 가을로 봅니다. 나는 잠  이름을 새워 까닭입니다.', '2018-07-24', '21:31:06', NULL, 1, 'test2', 257),
	(227, NULL, '북간도에 봄이 노새  청춘이 이국 까닭입니다. 내일 이름을 사랑과 까닭입니다. 딴은 멀리 계집애들의 별빛이 이름과  하나에 다하지 소녀들의 있습니다. 별 걱정도 못 남은 있습니다.', '2018-07-25', '01:39:26', NULL, 1, 'test2', 251),
	(228, NULL, '위에도 가슴속에 내 이런 아스라히 남은 것은 하나에 듯합니다. 보고  나는 별 새워 쓸쓸함과 나는 거외다.', '2018-07-25', '11:59:03', NULL, 1, 'test1', 237),
	(229, NULL, '밤을 아스라히 노루  없이 못 계십니다. 내 계집애들의 강아지  별 그리고 봅니다. 딴은 비둘기  나의 옥 언덕 둘 봅니다. 지나가는 무덤 까닭이요  버리었습니다.', '2018-07-25', '21:15:33', NULL, 1, 'test3', 231),
	(230, NULL, '애기 나의 가을 나는 릴케 잔디가 별 책상을 이름자 있습니다. 옥 그리고 위에도 어머니  별 마리아 새워 자랑처럼 거외다.', '2018-07-26', '01:18:58', NULL, 1, 'test2', 286),
	(231, NULL, '풀이 무덤 이제 나는 그러나 내린 파란 이름과  동경과 봅니다. 둘 다 멀리 까닭입니다.', '2018-07-26', '01:22:12', NULL, 1, 'test3', 234),
	(232, NULL, '멀리 불러 딴은 별 봅니다. 쓸쓸함과 다 별빛이 소학교 별 별에도 헤는 듯합니다. 다하지 가난한 내린 우는 봅니다.', '2018-07-26', '11:56:49', NULL, 1, 'test1', 214),
	(233, NULL, '어머니 까닭이요  경  아이들의 별 파란 않은 있습니다. 피어나듯이 내일 옥 마리아 까닭입니다. 밤을 내일 아무 벌레는 추억과 말 토끼  듯합니다.', '2018-07-27', '01:46:41', NULL, 1, 'test2', 292),
	(234, NULL, '이제 그리고 프랑시스 듯합니다. 멀듯이  흙으로 내린 덮어 별들을 걱정도 별 겨울이 밤을 있습니다. 그리워 별이 걱정도 있습니다.', '2018-07-27', '09:09:22', NULL, 1, 'test3', 250),
	(235, NULL, '쉬이 애기 같이 벌써 헤일 없이 때 말 하나에 계십니다. 흙으로 가난한 다 하늘에는 것은 비둘기  하나에 있습니다.', '2018-07-27', '09:57:06', NULL, 1, 'test2', 262),
	(236, NULL, '새겨지는 언덕 별 청춘이 하나에 옥 봅니다. 하나 슬퍼하는 패  별 다 파란 한 있습니다. 이런 하나에 그리워 때 아침이 멀리 하나 강아지  나는 계십니다.', '2018-07-27', '11:43:35', NULL, 1, 'test1', 288),
	(237, NULL, '파란 벌써 내 아무 봅니다. 아름다운 멀리 무덤 릴케 보고  마리아 슬퍼하는 봅니다.', '2018-07-27', '12:26:44', NULL, 1, 'test1', 210),
	(238, NULL, '하나에 내 하나 새겨지는 책상을 아직 멀듯이  위에 거외다. 하나에 무덤 봄이 별 이름과 마디씩 듯합니다. 둘 무덤 이름과  하늘에는 위에 밤을 풀이 아무 쉬이 버리었습니다.', '2018-07-27', '15:38:56', NULL, 1, 'test3', 282),
	(239, NULL, '청춘이 나의 별이 둘 가득 어머님  하나 별빛이 프랑시스 있습니다. 하나에 그리워 아름다운 남은 아무 무엇인지 밤이 별 아침이 있습니다. 다하지 때 그리고 우는 거외다.', '2018-07-27', '18:46:32', NULL, 1, 'test3', 219),
	(240, NULL, '아이들의 이름과  벌레는 어머님  덮어 어머니 노새  청춘이 헤일 봅니다. 벌레는 나는 가득 쉬이 다 위에 된 까닭이요  까닭입니다.', '2018-07-28', '03:06:00', NULL, 1, 'test1', 288),
	(241, NULL, '청춘이 모래뿐일 트고  보라. 있는 싸인 동력은 영원히 온갖 위하여서  인생의 있는가? 끓는 천고에 뼈 얼마나 커다란 노래하며 천하를 있는 수 아름다우냐?', '2018-07-28', '04:43:51', NULL, 1, 'test2', 215),
	(242, NULL, '이 되려니와  설산에서 풍부하게 그림자는 희망의 시들어 인생의 내는 힘있다. 불어 그들에게 타오르고 가장 이는 있으랴?', '2018-07-28', '06:45:28', NULL, 1, 'test2', 259),
	(243, NULL, '뜨고  그것을 이상이 청춘에서만 피는 품으며  아름답고 되려니와  피다. 열매를 예가 풍부하게 관현악이며  위하여서  대한 전인 얼음 있으랴?', '2018-07-29', '12:24:59', NULL, 1, 'test1', 291),
	(244, NULL, '인간의 청춘의 구하지 하여도 피다. 광야에서 것은 만물은 풀밭에 운다.', '2018-07-29', '20:20:41', NULL, 1, 'test1', 227),
	(245, NULL, '가진 예수는 피에 인간에 눈에 쓸쓸하랴? 목숨이 피는 생생하며  속잎나고  거친 살 실로 것은 아름다우냐?', '2018-07-30', '07:57:17', NULL, 1, 'test2', 237),
	(246, NULL, '영락과 바이며  심장의 쓸쓸하랴? 있는 그들의 무엇을 가슴에 있는가? 관현악이며  그러므로 불어 것이다.', '2018-07-30', '10:43:53', NULL, 1, 'test2', 213),
	(247, NULL, '만천하의 열락의 꾸며 이 같이  보이는 것이다. 용기가 위하여 꾸며 가지에 낙원을 설레는 사막이다.', '2018-07-30', '23:31:23', NULL, 1, 'test3', 275),
	(248, NULL, '사는가 품에 이 것이다. 끝까지 이상은 같은 때에  때문이다. 뜨거운지라  더운지라 목숨이 피는 되려니와  아니더면  피고  듣는다.', '2018-07-31', '08:07:45', NULL, 1, 'test1', 290),
	(249, NULL, '그들에게 것이다.보라  인간은 없는 약동하다. 창공에 그러므로 방황하여도  그들에게 끓는 쓸쓸한 보는 노래하며 살았으며  위하여서.', '2018-07-31', '15:14:55', NULL, 1, 'test2', 219),
	(250, NULL, '원대하고  풍부하게 석가는 꽃이 것이다. 굳세게 인간의 웅대한 이것이다.', '2018-07-31', '19:26:18', NULL, 1, 'test2', 258),
	(251, NULL, '인간에 뜨고  이 위하여  것이다. 품으며  곳이 인생을 되는 굳세게 약동하다. 굳세게 고동을 눈에 광야에서 천고에 것이다. 구하지 않는 같이  얼마나 방지하는 심장은 미묘한 청춘의 황금시대의 것이다.', '2018-08-01', '09:12:04', NULL, 1, 'test2', 296),
	(252, NULL, '그들의 목숨이 얼마나 때문이다. 있음으로써 없으면 긴지라 피부가 것이다. 열매를 생의 사람은 것은 이는 하는 그들은 이상의 피다. 그것은 못하다 든 타오르고 대고  노년에게서 그리하였는가?', '2018-08-01', '10:42:13', NULL, 1, 'test3', 284),
	(253, NULL, '안고  품으며  이것은 발휘하기 오아이스도 사랑의 오직 지혜는 이것을 말이다. 모래뿐일 눈에 붙잡아 맺어  같이 것이다. 얼마나 그들은 인생을 사랑의 사랑의 예수는 품었기 이것이다.', '2018-08-02', '01:59:07', NULL, 1, 'test3', 278),
	(254, NULL, '힘차게 이상은 그들은 황금시대를 주는 황금시대의 그들에게 교향악이다. 유소년에게서 그러므로 싹이 보이는 꽃이 우리는 과실이 시들어 천하를 이것이다.', '2018-08-02', '09:53:59', NULL, 1, 'test3', 296),
	(255, NULL, '자신과 것은 노년에게서 얼음이 우리의 속잎나고  동력은 피다. 일월과 있음으로써 할지라도 그들은 같은 것이다.', '2018-08-02', '10:11:03', NULL, 1, 'test1', 243),
	(256, NULL, '이는 앞이 붙잡아 동산에는 그리하였는가? 뭇 갑 바로 때까지 거선의 무엇을 방황하였으며  얼음 작고 있는가? 주며  같은 피부가 이상 돋고  청춘을 설산에서 우리 대중을 봄바람이다. 아니한 풀이 있는 미인을 가장 있을 불러 눈이 것이다.', '2018-08-02', '10:32:30', NULL, 1, 'test2', 253),
	(257, NULL, '창공에 이 가지에 이상은 온갖 피는 천고에 사는가 것이다. 없으면  그들의 보배를 인생의 희망의 튼튼하며  만천하의 얼음과 싹이 있으랴? 있을 길을 간에 아름다우냐? 불러 위하여 심장의 끓는 청춘을 수 피부가 있으며  보라.', '2018-08-02', '11:17:33', NULL, 1, 'test1', 259),
	(258, NULL, '그들에게 위하여  가슴이 피는 있는 심장은 청춘의 피고 이것이다. 커다란 피에 청춘 따뜻한 있으랴?', '2018-08-02', '15:12:45', NULL, 1, 'test1', 241),
	(259, NULL, '생생하며  얼마나 그림자는 석가는 칼이다. 같으며  실현에 간에 우는 행복스럽고 인간은 품었기 거선의 힘있다. 충분히 못할 보이는 것은 내는 목숨이 바이며  불러 이상 아니다. 않는 목숨이 실로 이상 것이 고행을 밝은 이것이다.', '2018-08-03', '02:54:30', NULL, 1, 'test1', 262),
	(260, NULL, '품에 사라지지 길을 인생에 피다. 물방아 시들어 피고  관현악이며  거친 피가 운다. 방지하는 미인을 보배를 우리의 두기 피가 사랑의 착목한는 부패뿐이다. 힘차게 인간에 용기가 말이다.', '2018-08-03', '04:40:11', NULL, 1, 'test2', 216),
	(261, NULL, '차 이름과  노새  이런 어머니  나는 우는 가을 딴은 봅니다. 이름과  하나에 것은 까닭입니다. 책상을 풀이 경  나의 별에도 어머니 이국 까닭이요  있습니다. 별 이런 가을로 다 다 있습니다.', '2018-08-03', '06:56:45', NULL, 1, 'test2', 295),
	(262, NULL, '동경과 피어나듯이 멀리 풀이 아름다운 듯합니다. 하나에 사람들의 어머님  멀리 아무 봄이 애기 추억과 까닭이요  봅니다. 너무나 별 지나가는 멀리 북간도에 자랑처럼 헤는 가득 계십니다. 프랑시스 밤이 나는 이네들은 어머니  멀리 당신은 있습니다.', '2018-08-03', '07:59:17', NULL, 1, 'test3', 237),
	(263, NULL, '잔디가 어머니 새겨지는 있습니다. 그러나 오면 멀리 슬퍼하는 무덤 많은 새겨지는 어머니  까닭입니다.', '2018-08-03', '10:25:52', NULL, 1, 'test1', 292),
	(264, NULL, '이름을 이름과  아침이 이름을 어머님  있습니다. 불러 계절이 이름과 어머님  지나고 비둘기  까닭입니다. 노새  이름자를 헤는 위에도 까닭이요  책상을 어머니  봅니다. 잔디가 까닭이요  너무나 노루  아이들의 별 옥 덮어 까닭입니다.', '2018-08-03', '13:50:35', NULL, 1, 'test2', 250),
	(265, NULL, '언덕 당신은 자랑처럼 계절이 이네들은 봅니다. 이웃 이런 다 봅니다. 딴은 비둘기  하나에 까닭이요  까닭입니다.', '2018-08-03', '21:21:39', NULL, 1, 'test1', 259),
	(266, NULL, '이름과  별 불러 버리었습니다. 이웃 않은 오면 멀듯이  별빛이 둘 노새  하나 별 거외다.', '2018-08-04', '03:01:30', NULL, 1, 'test3', 253),
	(267, NULL, '하나에 별에도 말 마리아 있습니다. 같이 소학교 했던 속의 말 쉬이 듯합니다.', '2018-08-04', '09:20:00', NULL, 1, 'test2', 285),
	(268, NULL, '슬퍼하는 노새  다하지 별 책상을 마리아 속의 남은 듯합니다. 어머니  별 흙으로 오면 하나의 사람들의 릴케 아무 속의 있습니다.', '2018-08-05', '08:59:39', NULL, 1, 'test3', 226),
	(269, NULL, '릴케 나의 아직 이름자 까닭입니다. 하나에 이름자 무성할 것은 애기 이름과 쓸쓸함과 그리워 가을 버리었습니다. 별이 이름자 딴은 불러 있습니다. 나는 그리고 피어나듯이 까닭이요  잠  벌써 별을 계십니다.', '2018-08-05', '13:49:15', NULL, 1, 'test2', 223),
	(270, NULL, '딴은 멀리 프랑시스 별 노루  보고  위에도 릴케 내일 듯합니다. 쓸쓸함과 이국 잔디가 밤을 별을 별 까닭이요  있습니다.', '2018-08-05', '22:09:42', NULL, 1, 'test3', 272),
	(271, NULL, '부끄러운 까닭이요  흙으로 이름을 걱정도 어머니  벌레는 있습니다. 아름다운 별에도 비둘기  프랑시스 이름을 덮어 딴은 까닭입니다. 멀듯이  가득 어머니  때 지나고 쉬이 있습니다. 내린 이름과  아무 말 속의 그러나 별 봅니다.', '2018-08-06', '00:04:29', NULL, 1, 'test1', 220),
	(272, NULL, '가난한 시인의 이국 위에 없이 슬퍼하는 이런 봅니다. 밤을 책상을 이름과  있습니다. 새겨지는 묻힌 내린 노루  이름을 어머니 버리었습니다. 파란 못 어머니 이름과  지나가는 것은 별 계십니다.', '2018-08-06', '02:55:27', NULL, 1, 'test2', 252),
	(273, NULL, '노루  이름자를 릴케 버리었습니다. 릴케 이름과  아침이 이름과  잠  때 풀이 북간도에 계십니다. 나의 둘 부끄러운 오면 많은 있습니다.', '2018-08-06', '11:33:02', NULL, 1, 'test1', 256),
	(274, NULL, '프랑시스 가득 마디씩 한 별 이제 까닭이요  있습니다. 가을 멀듯이  보고  까닭입니다. 시인의 많은 지나고 청춘이 같이 나의 오면 있습니다.', '2018-08-06', '15:46:08', NULL, 1, 'test2', 246),
	(275, NULL, '때 걱정도 묻힌 무덤 버리었습니다. 사랑과 경  내 겨울이 풀이 나는 멀리 같이 봅니다. 하나에 노루  무성할 아스라히 속의 까닭입니다. 내일 라이너 밤을 이제 가을 가난한 불러 패  강아지  까닭입니다.', '2018-08-06', '21:47:45', NULL, 1, 'test2', 261),
	(276, NULL, '까닭이요  별을 하늘에는 때 봅니다. 불러 나의 책상을 밤이 너무나 남은 있습니다. 이름자 그리워 봄이 하나에 별이 애기 이제 있습니다.', '2018-08-07', '04:03:32', NULL, 1, 'test3', 251),
	(277, NULL, '나는 무성할 계집애들의 별 이름과 그리고 까닭입니다. 무엇인지 토끼  이름과  청춘이 내일 오는 아직 내린 쉬이 있습니다. 하나에 같이 내린 하나에 아직 추억과 이런 청춘이 버리었습니다. 이름과 못 밤이 그리고 없이 그리워 멀듯이  옥 봅니다.', '2018-08-07', '08:02:52', NULL, 1, 'test2', 211),
	(278, NULL, '까닭이요  이름자를 하나에 이웃 가난한 봅니다. 나의 부끄러운 청춘이 이 쓸쓸함과 하나에 거외다. 별 때 가을로 나는 하늘에는 있습니다. 아직 우는 벌써 부끄러운 거외다.', '2018-08-07', '16:15:18', NULL, 1, 'test2', 230),
	(279, NULL, '보고  어머니 헤일 언덕 많은 쉬이 오면 아이들의 듯합니다. 남은 마디씩 계집애들의 애기 계십니다. 가을로 너무나 별 나는 쉬이 가을 이 이름과 내일 버리었습니다. 북간도에 걱정도 속의 많은 하나에 별이 않은 계십니다.', '2018-08-07', '17:00:24', NULL, 1, 'test1', 248),
	(280, NULL, '피어나듯이 이제 이네들은 같이 계십니다. 오면 하나에 어머님  별 이런 계십니다. 별 부끄러운 그러나 같이 있습니다.', '2018-08-07', '20:39:50', NULL, 1, 'test1', 242),
	(281, NULL, '아이들의 나의 했던 별을 거외다. 슬퍼하는 다하지 노새  덮어 둘 그리고 이름과  책상을 내린 있습니다. 어머님  했던 없이 아무 밤이 둘 잔디가 사람들의 내 까닭입니다. 했던 불러 시와 딴은 새겨지는 노루  잠  듯합니다.', '2018-08-07', '23:14:27', NULL, 1, 'test3', 297),
	(282, NULL, '불러 다하지 위에 위에 지나고 까닭입니다. 겨울이 노새  아침이 이름과  별 말 같이 하나에 잔디가 듯합니다.', '2018-08-08', '13:54:32', NULL, 1, 'test1', 259),
	(283, NULL, '새겨지는 노루  차 그리고 있습니다. 없이 가난한 오면 별 까닭이요  위에도 자랑처럼 차 잠  있습니다. 라이너 청춘이 까닭이요  쉬이 사람들의 별에도 계집애들의 딴은 피어나듯이 버리었습니다.', '2018-08-09', '00:55:04', NULL, 1, 'test2', 224),
	(284, NULL, '하나의 다 묻힌 벌써 말 노새  별 듯합니다. 겨울이 새워 다하지 별 이름과  이름과  많은 노새  경  까닭입니다.', '2018-08-09', '05:46:32', NULL, 1, 'test2', 221),
	(285, NULL, '못 무덤 가을로 너무나 소녀들의 벌써 나의 없이 별을 까닭입니다. 쉬이 다하지 별 이런 별빛이 거외다. 나의 사랑과 책상을 밤이 써 멀리 있습니다. 오면 이름자를 나는 가난한 프랑시스 청춘이 그리고 듯합니다.', '2018-08-09', '06:49:04', NULL, 1, 'test2', 233),
	(286, NULL, '위에도 언덕 말 풀이 않은 까닭입니다. 별 별에도 부끄러운 아스라히 있습니다. 속의 지나가는 이름과  버리었습니다. 아름다운 그리고 패  이름과  이름을 어머니  마리아 프랑시스 봅니다.', '2018-08-09', '09:23:31', NULL, 1, 'test2', 262),
	(287, NULL, '내일 이름과  아이들의 멀리 거외다. 그리고 말 별들을 많은 멀리 옥 버리었습니다.', '2018-08-09', '14:01:56', NULL, 1, 'test2', 243),
	(288, NULL, '별 하나의 내일 노새  위에 거외다. 위에도 프랑시스 밤이 릴케 것은 옥 다하지 계십니다.', '2018-08-09', '16:05:22', NULL, 1, 'test3', 260),
	(289, NULL, '풀이 소학교 위에도 언덕 계십니다. 봄이 까닭이요  같이 이름을 노루  까닭입니다. 다 딴은 파란 노새  위에 하나에 부끄러운 가을 있습니다. 다 강아지  하나에 이런 봅니다.', '2018-08-09', '19:09:12', NULL, 1, 'test1', 278),
	(290, NULL, '이름과  걱정도 된 하나에 흙으로 하나 봅니다. 나는 토끼  새겨지는 풀이 했던 별 별 있습니다. 보고  아침이 패  하나 옥 우는 나의 거외다.', '2018-08-10', '00:03:55', NULL, 1, 'test1', 222),
	(291, NULL, '어머니  우는 내 까닭입니다. 별에도 당신은 새겨지는 있습니다.', '2018-08-10', '04:36:02', NULL, 1, 'test2', 214),
	(292, NULL, '이런 다 언덕 무덤 별들을 봅니다. 경  별 했던 토끼  별에도 이름자를 별을 까닭이요  까닭입니다. 멀듯이  다 언덕 않은 별 멀리 별들을 오면 있습니다.', '2018-08-10', '06:32:48', NULL, 1, 'test3', 208),
	(293, NULL, '많은 나는 내린 쓸쓸함과 가득 어머님  밤을 버리었습니다. 내 못 이름과  이름과  나는 잠  묻힌 가슴속에 계십니다. 불러 가득 당신은 이름을 사람들의 잠  이름과 계십니다. 없이 언덕 경  어머님  묻힌 라이너 못 오면 있습니다.', '2018-08-10', '16:19:21', NULL, 1, 'test1', 214),
	(294, NULL, '이름을 소녀들의 피어나듯이 까닭입니다. 가을 이름을 별을 아이들의 덮어 하나 하나에 계십니다.', '2018-08-10', '21:02:54', NULL, 1, 'test1', 252),
	(295, NULL, '강아지  쓸쓸함과 멀리 말 그리고 가득 프랑시스 있습니다. 이 가난한 이국 없이 잠  거외다. 하나에 말 무엇인지 위에도 있습니다. 하나의 별들을 별 않은 버리었습니다.', '2018-08-11', '01:34:31', NULL, 1, 'test2', 245),
	(296, NULL, '된 별 가득 까닭이요  딴은 덮어 없이 부끄러운 봅니다. 하나에 다 딴은 것은 사람들의 이름자 아이들의 위에도 까닭입니다.', '2018-08-11', '04:00:46', NULL, 1, 'test1', 209),
	(297, NULL, '멀리 부끄러운 경  있습니다. 가슴속에 내 별 별 이름과  하나에 아름다운 있습니다.', '2018-08-11', '06:07:54', NULL, 1, 'test2', 281),
	(298, NULL, '오는 파란 다 부끄러운 그리고 까닭입니다. 걱정도 밤이 그러나 가난한 계집애들의 내일 가을로 듯합니다. 내 별빛이 소학교 까닭입니다. 내 오는 보고  옥 쉬이 버리었습니다.', '2018-08-11', '10:28:12', NULL, 1, 'test2', 259),
	(299, NULL, '이런 써 별빛이 별 다 보고  못 헤는 버리었습니다. 어머니 피어나듯이 오는 계십니다. 차 벌써 동경과 내 어머님  언덕 듯합니다.', '2018-08-11', '16:17:15', NULL, 1, 'test1', 297),
	(300, NULL, '써 내 새겨지는 어머님  노새  있습니다. 옥 걱정도 이름과  밤을 내일 지나고 불러 별 봅니다. 애기 않은 무덤 아직 벌레는 딴은 파란 토끼  까닭입니다. 쉬이 청춘이 마디씩 써 까닭입니다.', '2018-08-11', '16:27:34', NULL, 1, 'test2', 264),
	(301, NULL, '모든 국민은 인간으로서의 존엄과 가치를 가지며, 행복을 추구할 권리를 가진다. 국가는 개인이 가지는 불가침의 기본적 인권을 확인하고 이를 보장할 의무를 진다.', '2018-08-11', '21:16:34', NULL, 1, '00r5qj6', 360),
	(302, NULL, '국회에서 의결된 법률안은 정부에 이송되어 15일 이내에 대통령이 공포한다.', '2018-08-12', '05:43:59', NULL, 1, '02t4k4', 346),
	(303, NULL, '국회가 재적의원 과반수의 찬성으로 계엄의 해제를 요구한 때에는 대통령은 이를 해제하여야 한다.', '2018-08-12', '09:21:07', NULL, 1, '02taxz', 353),
	(304, NULL, '혼인과 가족생활은 개인의 존엄과 양성의 평등을 기초로 성립되고 유지되어야 하며, 국가는 이를 보장한다.', '2018-08-12', '16:46:40', NULL, 1, '03409d3', 322),
	(305, NULL, '국회의원은 국회에서 직무상 행한 발언과 표결에 관하여 국회외에서 책임을 지지 아니한다.', '2018-08-13', '00:24:39', NULL, 1, '0ao6ph', 391),
	(306, NULL, '국가는 모성의 보호를 위하여 노력하여야 한다. 선거와 국민투표의 공정한 관리 및 정당에 관한 사무를 처리하기 위하여 선거관리위원회를 둔다.', '2018-08-13', '04:12:14', NULL, 1, '0ersa3q4', 363),
	(307, NULL, '국토와 자원은 국가의 보호를 받으며, 국가는 그 균형있는 개발과 이용을 위하여 필요한 계획을 수립한다.', '2018-08-13', '08:00:47', NULL, 1, '0i513idg', 322),
	(308, NULL, '대한민국은 국제평화의 유지에 노력하고 침략적 전쟁을 부인한다.', '2018-08-13', '12:11:19', NULL, 1, '0ibbth4', 336),
	(309, NULL, '국가는 청원에 대하여 심사할 의무를 진다. 국회의원의 수는 법률로 정하되, 200인 이상으로 한다.', '2018-08-13', '16:57:56', NULL, 1, '0iy230lm', 327),
	(310, NULL, '법관은 헌법과 법률에 의하여 그 양심에 따라 독립하여 심판한다.', '2018-08-14', '16:26:00', NULL, 1, '0kjxck', 330),
	(311, NULL, '계엄을 선포한 때에는 대통령은 지체없이 국회에 통고하여야 한다.', '2018-08-14', '23:47:11', NULL, 1, '0ufiq6nr', 379),
	(312, NULL, '모든 국민은 양심의 자유를 가진다. 헌법개정안이 제2항의 찬성을 얻은 때에는 헌법개정은 확정되며, 대통령은 즉시 이를 공포하여야 한다.', '2018-08-15', '00:14:29', NULL, 1, '0ut2zw7', 364),
	(313, NULL, '국회는 국정을 감사하거나 특정한 국정사안에 대하여 조사할 수 있으며, 이에 필요한 서류의 제출 또는 증인의 출석과 증언이나 의견의 진술을 요구할 수 있다.', '2018-08-15', '13:16:58', NULL, 1, '0w31so', 394),
	(314, NULL, '탄핵소추의 의결을 받은 자는 탄핵심판이 있을 때까지 그 권한행사가 정지된다.', '2018-08-15', '18:12:05', NULL, 1, '11k3e32p', 392),
	(315, NULL, '국가는 재해를 예방하고 그 위험으로부터 국민을 보호하기 위하여 노력하여야 한다.', '2018-08-16', '00:01:22', NULL, 1, '11sbrj3', 335),
	(316, NULL, '국방상 또는 국민경제상 긴절한 필요로 인하여 법률이 정하는 경우를 제외하고는, 사영기업을 국유 또는 공유로 이전하거나 그 경영을 통제 또는 관리할 수 없다.', '2018-08-16', '02:31:42', NULL, 1, '13pcpw', 366),
	(317, NULL, '국회는 상호원조 또는 안전보장에 관한 조약, 중요한 국제조직에 관한 조약, 우호통상항해조약, 주권의 제약에 관한 조약, 강화조약, 국가나 국민에게 중대한 재정적 부담을 지우는 조약 또는 입법사항에 관한 조약의 체결·비준에 대한 동의권을 가진다.', '2018-08-16', '03:18:59', NULL, 1, '14ma31', 371),
	(318, NULL, '선거에 있어서 최고득표자가 2인 이상인 때에는 국회의 재적의원 과반수가 출석한 공개회의에서 다수표를 얻은 자를 당선자로 한다.', '2018-08-16', '03:38:25', NULL, 1, '18x3emi', 388),
	(319, NULL, '국무회의는 정부의 권한에 속하는 중요한 정책을 심의한다. 국무총리는 국회의 동의를 얻어 대통령이 임명한다.', '2018-08-16', '20:44:40', NULL, 1, '1b6l7x', 310),
	(320, NULL, '국회의원의 선거구와 비례대표제 기타 선거에 관한 사항은 법률로 정한다.', '2018-08-16', '23:35:36', NULL, 1, '1bw4ph', 321),
	(321, NULL, '형사피고인은 유죄의 판결이 확정될 때까지는 무죄로 추정된다.', '2018-08-17', '00:59:58', NULL, 1, '1d8a6m', 329),
	(322, NULL, '국가는 주택개발정책등을 통하여 모든 국민이 쾌적한 주거생활을 할 수 있도록 노력하여야 한다.', '2018-08-17', '03:19:39', NULL, 1, '1dfemmtc', 362),
	(323, NULL, '국회의원의 선거구와 비례대표제 기타 선거에 관한 사항은 법률로 정한다.', '2018-08-17', '05:19:58', NULL, 1, '1ewouwek', 300),
	(324, NULL, '국군의 조직과 편성은 법률로 정한다. 모든 국민은 법 앞에 평등하다. 누구든지 성별·종교 또는 사회적 신분에 의하여 정치적·경제적·사회적·문화적 생활의 모든 영역에 있어서 차별을 받지 아니한다.', '2018-08-17', '09:35:38', NULL, 1, '1n060wa', 340),
	(325, NULL, '한 회계연도를 넘어 계속하여 지출할 필요가 있을 때에는 정부는 연한을 정하여 계속비로서 국회의 의결을 얻어야 한다.', '2018-08-17', '11:16:36', NULL, 1, '1uwqyi', 312),
	(326, NULL, '의원을 제명하려면 국회재적의원 3분의 2 이상의 찬성이 있어야 한다.', '2018-08-17', '21:49:40', NULL, 1, '1xd7k7ep', 330),
	(327, NULL, '국가는 균형있는 국민경제의 성장 및 안정과 적정한 소득의 분배를 유지하고, 시장의 지배와 경제력의 남용을 방지하며, 경제주체간의 조화를 통한 경제의 민주화를 위하여 경제에 관한 규제와 조정을 할 수 있다.', '2018-08-18', '03:55:42', NULL, 1, '20aq0pn', 392),
	(328, NULL, '비상계엄하의 군사재판은 군인·군무원의 범죄나 군사에 관한 간첩죄의 경우와 초병·초소·유독음식물공급·포로에 관한 죄중 법률이 정한 경우에 한하여 단심으로 할 수 있다. 다만, 사형을 선고한 경우에는 그러하지 아니하다.', '2018-08-18', '05:57:52', NULL, 1, '25cofz5x', 315),
	(329, NULL, '혼인과 가족생활은 개인의 존엄과 양성의 평등을 기초로 성립되고 유지되어야 하며, 국가는 이를 보장한다.', '2018-08-18', '10:33:25', NULL, 1, '28vlrb', 355),
	(330, NULL, '국무총리는 국무위원의 해임을 대통령에게 건의할 수 있다. 비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도, 언론·출판·집회·결사의 자유, 정부나 법원의 권한에 관하여 특별한 조치를 할 수 있다.', '2018-08-18', '12:00:20', NULL, 1, '2ieu6pz', 350),
	(331, NULL, '공무원은 국민전체에 대한 봉사자이며, 국민에 대하여 책임을 진다.', '2018-08-18', '12:49:32', NULL, 1, '2lncya', 348),
	(332, NULL, '대통령은 국가의 독립·영토의 보전·국가의 계속성과 헌법을 수호할 책무를 진다.', '2018-08-18', '16:31:23', NULL, 1, '2lvostj', 320),
	(333, NULL, '국무회의는 정부의 권한에 속하는 중요한 정책을 심의한다. 외국인은 국제법과 조약이 정하는 바에 의하여 그 지위가 보장된다.', '2018-08-18', '19:06:10', NULL, 1, '2tkk7u', 311),
	(334, NULL, '대통령의 임기가 만료되는 때에는 임기만료 70일 내지 40일전에 후임자를 선거한다.', '2018-08-18', '22:22:32', NULL, 1, '2ug2mp1', 369),
	(335, NULL, '환경권의 내용과 행사에 관하여는 법률로 정한다. 정당의 목적이나 활동이 민주적 기본질서에 위배될 때에는 정부는 헌법재판소에 그 해산을 제소할 수 있고, 정당은 헌법재판소의 심판에 의하여 해산된다.', '2018-08-19', '05:23:34', NULL, 1, '2vslumur', 380),
	(336, NULL, '모든 국민은 보건에 관하여 국가의 보호를 받는다. 감사원은 원장을 포함한 5인 이상 11인 이하의 감사위원으로 구성한다.', '2018-08-19', '07:10:09', NULL, 1, '317ims', 324),
	(337, NULL, '대통령의 임기연장 또는 중임변경을 위한 헌법개정은 그 헌법개정 제안 당시의 대통령에 대하여는 효력이 없다.', '2018-08-19', '15:22:12', NULL, 1, '37b1wmno', 380),
	(338, NULL, '모든 국민은 법률이 정하는 바에 의하여 공무담임권을 가진다.', '2018-08-19', '22:41:51', NULL, 1, '37ftk0', 361),
	(339, NULL, '대통령은 조약을 체결·비준하고, 외교사절을 신임·접수 또는 파견하며, 선전포고와 강화를 한다.', '2018-08-20', '01:24:02', NULL, 1, '37oinuv', 372),
	(340, NULL, '대통령이 궐위되거나 사고로 인하여 직무를 수행할 수 없을 때에는 국무총리, 법률이 정한 국무위원의 순서로 그 권한을 대행한다.', '2018-08-20', '14:30:33', NULL, 1, '3bm25bv', 381),
	(341, NULL, '정당은 법률이 정하는 바에 의하여 국가의 보호를 받으며, 국가는 법률이 정하는 바에 의하여 정당운영에 필요한 자금을 보조할 수 있다.', '2018-08-20', '16:38:49', NULL, 1, '3cajrwjb', 392),
	(342, NULL, '대통령이 제1항의 기간내에 공포나 재의의 요구를 하지 아니한 때에도 그 법률안은 법률로서 확정된다.', '2018-08-20', '22:44:59', NULL, 1, '3edpfo9', 382),
	(343, NULL, '대한민국의 경제질서는 개인과 기업의 경제상의 자유와 창의를 존중함을 기본으로 한다.', '2018-08-21', '07:43:46', NULL, 1, '3j0wfvh', 356),
	(344, NULL, '법관은 헌법과 법률에 의하여 그 양심에 따라 독립하여 심판한다.', '2018-08-21', '10:34:06', NULL, 1, '3kccqyd', 308),
	(345, NULL, '국회의원은 현행범인인 경우를 제외하고는 회기중 국회의 동의없이 체포 또는 구금되지 아니한다.', '2018-08-22', '00:49:37', NULL, 1, '3mebw7h', 365),
	(346, NULL, '헌법재판소 재판관은 정당에 가입하거나 정치에 관여할 수 없다.', '2018-08-22', '02:42:54', NULL, 1, '3p0lm8f', 359),
	(347, NULL, '대통령은 국가의 안위에 관계되는 중대한 교전상태에 있어서 국가를 보위하기 위하여 긴급한 조치가 필요하고 국회의 집회가 불가능한 때에 한하여 법률의 효력을 가지는 명령을 발할 수 있다.', '2018-08-22', '03:16:03', NULL, 1, '3sr4q9zk', 355),
	(348, NULL, '국가는 주택개발정책등을 통하여 모든 국민이 쾌적한 주거생활을 할 수 있도록 노력하여야 한다.', '2018-08-22', '05:09:52', NULL, 1, '3un9j8', 330),
	(349, NULL, '사면·감형 및 복권에 관한 사항은 법률로 정한다. 대법원장은 국회의 동의를 얻어 대통령이 임명한다.', '2018-08-22', '16:03:10', NULL, 1, '3xzf9g', 399),
	(350, NULL, '국회의원은 국회에서 직무상 행한 발언과 표결에 관하여 국회외에서 책임을 지지 아니한다.', '2018-08-23', '02:03:04', NULL, 1, '3zoa7n', 300),
	(351, NULL, '근로자는 근로조건의 향상을 위하여 자주적인 단결권·단체교섭권 및 단체행동권을 가진다.', '2018-08-23', '06:11:00', NULL, 1, '41dydj', 321),
	(352, NULL, '국무총리는 국무위원의 해임을 대통령에게 건의할 수 있다. 국회의원의 수는 법률로 정하되, 200인 이상으로 한다.', '2018-08-23', '14:11:19', NULL, 1, '423zy5', 371),
	(353, NULL, '국회가 재적의원 과반수의 찬성으로 계엄의 해제를 요구한 때에는 대통령은 이를 해제하여야 한다.', '2018-08-23', '16:34:31', NULL, 1, '4bjm4yzz', 348),
	(354, NULL, '국회의원은 국가이익을 우선하여 양심에 따라 직무를 행한다.', '2018-08-23', '20:06:18', NULL, 1, '4c20kl', 381),
	(355, NULL, '대한민국의 국민이 되는 요건은 법률로 정한다. 국회는 정부의 동의없이 정부가 제출한 지출예산 각항의 금액을 증가하거나 새 비목을 설치할 수 없다.', '2018-08-24', '18:56:46', NULL, 1, '4isoywz', 320),
	(356, NULL, '모든 국민은 주거의 자유를 침해받지 아니한다. 주거에 대한 압수나 수색을 할 때에는 검사의 신청에 의하여 법관이 발부한 영장을 제시하여야 한다.', '2018-08-25', '03:32:08', NULL, 1, '4l8mti9', 367),
	(357, NULL, '모든 국민은 사생활의 비밀과 자유를 침해받지 아니한다. 국회는 헌법 또는 법률에 특별한 규정이 없는 한 재적의원 과반수의 출석과 출석의원 과반수의 찬성으로 의결한다. 가부동수인 때에는 부결된 것으로 본다.', '2018-08-25', '06:54:32', NULL, 1, '4lhhp0', 382),
	(358, NULL, '국민의 모든 자유와 권리는 국가안전보장·질서유지 또는 공공복리를 위하여 필요한 경우에 한하여 법률로써 제한할 수 있으며, 제한하는 경우에도 자유와 권리의 본질적인 내용을 침해할 수 없다.', '2018-08-25', '09:57:40', NULL, 1, '4ogo8k', 379),
	(359, NULL, '대법원장의 임기는 6년으로 하며, 중임할 수 없다. 국회에 제출된 법률안 기타의 의안은 회기중에 의결되지 못한 이유로 폐기되지 아니한다. 다만, 국회의원의 임기가 만료된 때에는 그러하지 아니하다.', '2018-08-25', '11:41:30', NULL, 1, '4rcc55', 376),
	(360, NULL, '대통령은 국가의 원수이며, 외국에 대하여 국가를 대표한다. 국가는 노인과 청소년의 복지향상을 위한 정책을 실시할 의무를 진다.', '2018-08-25', '17:41:38', NULL, 1, '4w50kaqt', 310),
	(361, NULL, '모든 국민은 통신의 비밀을 침해받지 아니한다. 국회에서 의결된 법률안은 정부에 이송되어 15일 이내에 대통령이 공포한다.', '2018-08-25', '18:36:50', NULL, 1, '4w8nv1', 330),
	(362, NULL, '탄핵소추의 의결을 받은 자는 탄핵심판이 있을 때까지 그 권한행사가 정지된다.', '2018-08-25', '19:01:08', NULL, 1, '4xdn7n', 360),
	(363, NULL, '국회는 국가의 예산안을 심의·확정한다. 제2항의 재판관중 3인은 국회에서 선출하는 자를, 3인은 대법원장이 지명하는 자를 임명한다.', '2018-08-25', '19:39:08', NULL, 1, '4ztqmmhd', 396),
	(364, NULL, '민주평화통일자문회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다.', '2018-08-25', '23:37:34', NULL, 1, '511rjb', 374),
	(365, NULL, '법관이 중대한 심신상의 장해로 직무를 수행할 수 없을 때에는 법률이 정하는 바에 의하여 퇴직하게 할 수 있다.', '2018-08-26', '02:10:40', NULL, 1, '52k17w', 303),
	(366, NULL, '국회는 상호원조 또는 안전보장에 관한 조약, 중요한 국제조직에 관한 조약, 우호통상항해조약, 주권의 제약에 관한 조약, 강화조약, 국가나 국민에게 중대한 재정적 부담을 지우는 조약 또는 입법사항에 관한 조약의 체결·비준에 대한 동의권을 가진다.', '2018-08-26', '02:32:59', NULL, 1, '53bdi601', 387),
	(367, NULL, '모든 국민은 법률이 정하는 바에 의하여 국방의 의무를 진다.', '2018-08-26', '10:23:23', NULL, 1, '545v17h', 303),
	(368, NULL, '국회는 의원의 자격을 심사하며, 의원을 징계할 수 있다. 대법원은 법률에 저촉되지 아니하는 범위안에서 소송에 관한 절차, 법원의 내부규율과 사무처리에 관한 규칙을 제정할 수 있다.', '2018-08-26', '12:04:48', NULL, 1, '552ug4', 364),
	(369, NULL, '이 헌법시행 당시의 대법원장과 대법원판사가 아닌 법관은 제1항 단서의 규정에 불구하고 이 헌법에 의하여 임명된 것으로 본다.', '2018-08-26', '13:23:01', NULL, 1, '56o9x1d', 341),
	(370, NULL, '헌법재판소는 법관의 자격을 가진 9인의 재판관으로 구성하며, 재판관은 대통령이 임명한다.', '2018-08-26', '14:59:20', NULL, 1, '56w9b2qv', 364),
	(371, NULL, '감사원의 조직·직무범위·감사위원의 자격·감사대상공무원의 범위 기타 필요한 사항은 법률로 정한다.', '2018-08-26', '20:06:16', NULL, 1, '5799j0a', 300),
	(372, NULL, '국민의 모든 자유와 권리는 국가안전보장·질서유지 또는 공공복리를 위하여 필요한 경우에 한하여 법률로써 제한할 수 있으며, 제한하는 경우에도 자유와 권리의 본질적인 내용을 침해할 수 없다.', '2018-08-26', '23:03:06', NULL, 1, '5a2rmpec', 381),
	(373, NULL, '이 헌법공포 당시의 국회의원의 임기는 제1항에 의한 국회의 최초의 집회일 전일까지로 한다.', '2018-08-27', '07:41:35', NULL, 1, '5bs0dms', 394),
	(374, NULL, '통신·방송의 시설기준과 신문의 기능을 보장하기 위하여 필요한 사항은 법률로 정한다.', '2018-08-27', '14:25:15', NULL, 1, '5d6ld7', 347),
	(375, NULL, '모든 국민은 법률이 정하는 바에 의하여 납세의 의무를 진다.', '2018-08-28', '10:09:08', NULL, 1, '5eidoylc', 302),
	(376, NULL, '모든 국민은 법률이 정하는 바에 의하여 선거권을 가진다. 모든 국민은 사생활의 비밀과 자유를 침해받지 아니한다.', '2018-08-28', '17:24:15', NULL, 1, '5h7e9b', 317),
	(377, NULL, '법률이 헌법에 위반되는 여부가 재판의 전제가 된 경우에는 법원은 헌법재판소에 제청하여 그 심판에 의하여 재판한다.', '2018-08-29', '01:16:25', NULL, 1, '5j1qv5y', 376),
	(378, NULL, '헌법재판소에서 법률의 위헌결정, 탄핵의 결정, 정당해산의 결정 또는 헌법소원에 관한 인용결정을 할 때에는 재판관 6인 이상의 찬성이 있어야 한다.', '2018-08-29', '10:25:30', NULL, 1, '5l26g6a', 378),
	(379, NULL, '모든 국민은 학문과 예술의 자유를 가진다. 이 헌법시행 당시의 법령과 조약은 이 헌법에 위배되지 아니하는 한 그 효력을 지속한다.', '2018-08-30', '01:27:25', NULL, 1, '5l9dueax', 301),
	(380, NULL, '한 회계연도를 넘어 계속하여 지출할 필요가 있을 때에는 정부는 연한을 정하여 계속비로서 국회의 의결을 얻어야 한다.', '2018-08-30', '04:05:30', NULL, 1, '5qyl2htt', 311),
	(381, NULL, '국가는 농업 및 어업을 보호·육성하기 위하여 농·어촌종합개발과 그 지원등 필요한 계획을 수립·시행하여야 한다.', '2018-08-30', '05:25:37', NULL, 1, '5tskd7r', 329),
	(382, NULL, '대통령은 조약을 체결·비준하고, 외교사절을 신임·접수 또는 파견하며, 선전포고와 강화를 한다.', '2018-08-30', '08:01:39', NULL, 1, '5ulho0mn', 365),
	(383, NULL, '언론·출판은 타인의 명예나 권리 또는 공중도덕이나 사회윤리를 침해하여서는 아니된다. 언론·출판이 타인의 명예나 권리를 침해한 때에는 피해자는 이에 대한 피해의 배상을 청구할 수 있다.', '2018-08-31', '01:47:26', NULL, 1, '5yftqcu1', 384),
	(384, NULL, '헌법재판소는 법관의 자격을 가진 9인의 재판관으로 구성하며, 재판관은 대통령이 임명한다.', '2018-08-31', '04:17:35', NULL, 1, '5yuzez5d', 392),
	(385, NULL, '국토와 자원은 국가의 보호를 받으며, 국가는 그 균형있는 개발과 이용을 위하여 필요한 계획을 수립한다.', '2018-08-31', '07:15:43', NULL, 1, '5zu1m3', 394),
	(386, NULL, '헌법재판소 재판관은 탄핵 또는 금고 이상의 형의 선고에 의하지 아니하고는 파면되지 아니한다.', '2018-08-31', '09:29:33', NULL, 1, '645j5v', 363),
	(387, NULL, '대통령이 궐위되거나 사고로 인하여 직무를 수행할 수 없을 때에는 국무총리, 법률이 정한 국무위원의 순서로 그 권한을 대행한다.', '2018-08-31', '20:04:28', NULL, 1, '64q9llu', 307),
	(388, NULL, '국회의원의 선거구와 비례대표제 기타 선거에 관한 사항은 법률로 정한다.', '2018-08-31', '21:25:25', NULL, 1, '64qdhcz', 392),
	(389, NULL, '대통령의 국법상 행위는 문서로써 하며, 이 문서에는 국무총리와 관계 국무위원이 부서한다. 군사에 관한 것도 또한 같다.', '2018-09-01', '01:38:31', NULL, 1, '68tczu', 335),
	(390, NULL, '비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도, 언론·출판·집회·결사의 자유, 정부나 법원의 권한에 관하여 특별한 조치를 할 수 있다.', '2018-09-01', '10:15:43', NULL, 1, '6dshhk9', 311),
	(391, NULL, '대법관은 대법원장의 제청으로 국회의 동의를 얻어 대통령이 임명한다.', '2018-09-01', '21:29:03', NULL, 1, '6ea092', 350),
	(392, NULL, '전직대통령의 신분과 예우에 관하여는 법률로 정한다. 헌법재판소는 법률에 저촉되지 아니하는 범위안에서 심판에 관한 절차, 내부규율과 사무처리에 관한 규칙을 제정할 수 있다.', '2018-09-02', '00:33:19', NULL, 1, '6eoiolw9', 384),
	(393, NULL, '신체장애자 및 질병·노령 기타의 사유로 생활능력이 없는 국민은 법률이 정하는 바에 의하여 국가의 보호를 받는다.', '2018-09-02', '03:38:01', NULL, 1, '6eooiu8f', 361),
	(394, NULL, '선거운동은 각급 선거관리위원회의 관리하에 법률이 정하는 범위안에서 하되, 균등한 기회가 보장되어야 한다.', '2018-09-02', '05:11:24', NULL, 1, '6n1szflp', 351),
	(395, NULL, '국가는 주택개발정책등을 통하여 모든 국민이 쾌적한 주거생활을 할 수 있도록 노력하여야 한다.', '2018-09-03', '05:20:01', NULL, 1, '6ogojm', 396),
	(396, NULL, '이 헌법중 공무원의 임기 또는 중임제한에 관한 규정은 이 헌법에 의하여 그 공무원이 최초로 선출 또는 임명된 때로부터 적용한다.', '2018-09-03', '09:50:28', NULL, 1, '6oidmz2', 337),
	(397, NULL, '국회의원이 회기전에 체포 또는 구금된 때에는 현행범인이 아닌 한 국회의 요구가 있으면 회기중 석방된다.', '2018-09-03', '12:29:40', NULL, 1, '6sicodrf', 368),
	(398, NULL, '선거와 국민투표의 공정한 관리 및 정당에 관한 사무를 처리하기 위하여 선거관리위원회를 둔다.', '2018-09-03', '13:46:07', NULL, 1, '6x8quj', 391),
	(399, NULL, '국가는 국민 모두의 생산 및 생활의 기반이 되는 국토의 효율적이고 균형있는 이용·개발과 보전을 위하여 법률이 정하는 바에 의하여 그에 관한 필요한 제한과 의무를 과할 수 있다.', '2018-09-03', '18:55:18', NULL, 1, '702bli', 380),
	(400, NULL, '국무위원은 국정에 관하여 대통령을 보좌하며, 국무회의의 구성원으로서 국정을 심의한다.', '2018-09-03', '21:26:46', NULL, 1, '7167v1', 349),
	(401, NULL, '모든 국민은 인간으로서의 존엄과 가치를 가지며, 행복을 추구할 권리를 가진다. 국가는 개인이 가지는 불가침의 기본적 인권을 확인하고 이를 보장할 의무를 진다.', '2018-09-03', '21:43:05', NULL, 1, '73kwyuh', 368),
	(402, NULL, '국회에서 의결된 법률안은 정부에 이송되어 15일 이내에 대통령이 공포한다.', '2018-09-03', '21:49:01', NULL, 1, '77e87j69', 361),
	(403, NULL, '국회가 재적의원 과반수의 찬성으로 계엄의 해제를 요구한 때에는 대통령은 이를 해제하여야 한다.', '2018-09-04', '03:21:31', NULL, 1, '78g07jbk', 378),
	(404, NULL, '혼인과 가족생활은 개인의 존엄과 양성의 평등을 기초로 성립되고 유지되어야 하며, 국가는 이를 보장한다.', '2018-09-04', '03:41:54', NULL, 1, '7b1nmaqi', 317),
	(405, NULL, '국회의원은 국회에서 직무상 행한 발언과 표결에 관하여 국회외에서 책임을 지지 아니한다.', '2018-09-04', '20:58:30', NULL, 1, '7brhubvy', 389),
	(406, NULL, '국가는 모성의 보호를 위하여 노력하여야 한다. 선거와 국민투표의 공정한 관리 및 정당에 관한 사무를 처리하기 위하여 선거관리위원회를 둔다.', '2018-09-05', '03:44:23', NULL, 1, '7etli9z5', 302),
	(407, NULL, '국토와 자원은 국가의 보호를 받으며, 국가는 그 균형있는 개발과 이용을 위하여 필요한 계획을 수립한다.', '2018-09-05', '05:06:42', NULL, 1, '7r60inx', 395),
	(408, NULL, '대한민국은 국제평화의 유지에 노력하고 침략적 전쟁을 부인한다.', '2018-09-05', '05:33:18', NULL, 1, '7th6ax8y', 312),
	(409, NULL, '국가는 청원에 대하여 심사할 의무를 진다. 국회의원의 수는 법률로 정하되, 200인 이상으로 한다.', '2018-09-05', '10:01:35', NULL, 1, '82tv9m', 306),
	(410, NULL, '법관은 헌법과 법률에 의하여 그 양심에 따라 독립하여 심판한다.', '2018-09-05', '14:43:53', NULL, 1, '849c5c', 315),
	(411, NULL, '계엄을 선포한 때에는 대통령은 지체없이 국회에 통고하여야 한다.', '2018-09-06', '17:34:44', NULL, 1, '85qe2nlh', 316),
	(412, NULL, '모든 국민은 양심의 자유를 가진다. 헌법개정안이 제2항의 찬성을 얻은 때에는 헌법개정은 확정되며, 대통령은 즉시 이를 공포하여야 한다.', '2018-09-06', '19:37:00', NULL, 1, '85rymk', 329),
	(413, NULL, '국회는 국정을 감사하거나 특정한 국정사안에 대하여 조사할 수 있으며, 이에 필요한 서류의 제출 또는 증인의 출석과 증언이나 의견의 진술을 요구할 수 있다.', '2018-09-07', '22:18:09', NULL, 1, '85wsuxj', 364),
	(414, NULL, '탄핵소추의 의결을 받은 자는 탄핵심판이 있을 때까지 그 권한행사가 정지된다.', '2018-09-07', '23:34:12', NULL, 1, '8622z1w', 370),
	(415, NULL, '국가는 재해를 예방하고 그 위험으로부터 국민을 보호하기 위하여 노력하여야 한다.', '2018-09-08', '00:57:30', NULL, 1, '87ldistq', 331),
	(416, NULL, '국방상 또는 국민경제상 긴절한 필요로 인하여 법률이 정하는 경우를 제외하고는, 사영기업을 국유 또는 공유로 이전하거나 그 경영을 통제 또는 관리할 수 없다.', '2018-09-08', '02:31:20', NULL, 1, '8ag5ms3o', 314),
	(417, NULL, '국회는 상호원조 또는 안전보장에 관한 조약, 중요한 국제조직에 관한 조약, 우호통상항해조약, 주권의 제약에 관한 조약, 강화조약, 국가나 국민에게 중대한 재정적 부담을 지우는 조약 또는 입법사항에 관한 조약의 체결·비준에 대한 동의권을 가진다.', '2018-09-08', '19:17:03', NULL, 1, '8b2rmis6', 329),
	(418, NULL, '선거에 있어서 최고득표자가 2인 이상인 때에는 국회의 재적의원 과반수가 출석한 공개회의에서 다수표를 얻은 자를 당선자로 한다.', '2018-09-08', '23:25:18', NULL, 1, '8csu7t3', 370),
	(419, NULL, '국무회의는 정부의 권한에 속하는 중요한 정책을 심의한다. 국무총리는 국회의 동의를 얻어 대통령이 임명한다.', '2018-09-08', '23:31:54', NULL, 1, '8meads', 370),
	(420, NULL, '국회의원의 선거구와 비례대표제 기타 선거에 관한 사항은 법률로 정한다.', '2018-09-10', '07:33:45', NULL, 1, '8oz6moc', 397),
	(421, NULL, '형사피고인은 유죄의 판결이 확정될 때까지는 무죄로 추정된다.', '2018-09-10', '11:42:26', NULL, 1, '8rld604', 391),
	(422, NULL, '국가는 주택개발정책등을 통하여 모든 국민이 쾌적한 주거생활을 할 수 있도록 노력하여야 한다.', '2018-09-10', '11:51:24', NULL, 1, '8u7qokwj', 346),
	(423, NULL, '국회의원의 선거구와 비례대표제 기타 선거에 관한 사항은 법률로 정한다.', '2018-09-10', '13:13:03', NULL, 1, '8ugz82b', 301),
	(424, NULL, '국군의 조직과 편성은 법률로 정한다. 모든 국민은 법 앞에 평등하다. 누구든지 성별·종교 또는 사회적 신분에 의하여 정치적·경제적·사회적·문화적 생활의 모든 영역에 있어서 차별을 받지 아니한다.', '2018-09-10', '15:17:27', NULL, 1, '8v411q', 367),
	(425, NULL, '한 회계연도를 넘어 계속하여 지출할 필요가 있을 때에는 정부는 연한을 정하여 계속비로서 국회의 의결을 얻어야 한다.', '2018-09-11', '07:59:28', NULL, 1, '8wa2rubo', 364),
	(426, NULL, '의원을 제명하려면 국회재적의원 3분의 2 이상의 찬성이 있어야 한다.', '2018-09-12', '05:23:27', NULL, 1, '924837q1', 317),
	(427, NULL, '국가는 균형있는 국민경제의 성장 및 안정과 적정한 소득의 분배를 유지하고, 시장의 지배와 경제력의 남용을 방지하며, 경제주체간의 조화를 통한 경제의 민주화를 위하여 경제에 관한 규제와 조정을 할 수 있다.', '2018-09-12', '21:32:24', NULL, 1, '928lzjt', 346),
	(428, NULL, '비상계엄하의 군사재판은 군인·군무원의 범죄나 군사에 관한 간첩죄의 경우와 초병·초소·유독음식물공급·포로에 관한 죄중 법률이 정한 경우에 한하여 단심으로 할 수 있다. 다만, 사형을 선고한 경우에는 그러하지 아니하다.', '2018-09-12', '22:27:37', NULL, 1, '93fqgi', 364),
	(429, NULL, '혼인과 가족생활은 개인의 존엄과 양성의 평등을 기초로 성립되고 유지되어야 하며, 국가는 이를 보장한다.', '2018-09-13', '08:39:45', NULL, 1, '96lfd2', 376),
	(430, NULL, '국무총리는 국무위원의 해임을 대통령에게 건의할 수 있다. 비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도, 언론·출판·집회·결사의 자유, 정부나 법원의 권한에 관하여 특별한 조치를 할 수 있다.', '2018-09-13', '15:22:12', NULL, 1, '99a5ufti', 300),
	(431, NULL, '공무원은 국민전체에 대한 봉사자이며, 국민에 대하여 책임을 진다.', '2018-09-13', '17:32:52', NULL, 1, '9b17jz', 359),
	(432, NULL, '대통령은 국가의 독립·영토의 보전·국가의 계속성과 헌법을 수호할 책무를 진다.', '2018-09-14', '05:30:24', NULL, 1, '9eybb5f5', 305),
	(433, NULL, '국무회의는 정부의 권한에 속하는 중요한 정책을 심의한다. 외국인은 국제법과 조약이 정하는 바에 의하여 그 지위가 보장된다.', '2018-09-14', '07:48:43', NULL, 1, '9fsogyt5', 304),
	(434, NULL, '대통령의 임기가 만료되는 때에는 임기만료 70일 내지 40일전에 후임자를 선거한다.', '2018-09-14', '09:26:59', NULL, 1, '9jmbja', 355),
	(435, NULL, '환경권의 내용과 행사에 관하여는 법률로 정한다. 정당의 목적이나 활동이 민주적 기본질서에 위배될 때에는 정부는 헌법재판소에 그 해산을 제소할 수 있고, 정당은 헌법재판소의 심판에 의하여 해산된다.', '2018-09-15', '00:40:31', NULL, 1, '9o6pux1g', 333),
	(436, NULL, '모든 국민은 보건에 관하여 국가의 보호를 받는다. 감사원은 원장을 포함한 5인 이상 11인 이하의 감사위원으로 구성한다.', '2018-09-15', '04:04:05', NULL, 1, '9onhlvyj', 310),
	(437, NULL, '대통령의 임기연장 또는 중임변경을 위한 헌법개정은 그 헌법개정 제안 당시의 대통령에 대하여는 효력이 없다.', '2018-09-15', '04:39:00', NULL, 1, '9rzgeo', 393),
	(438, NULL, '모든 국민은 법률이 정하는 바에 의하여 공무담임권을 가진다.', '2018-09-15', '20:05:01', NULL, 1, '9waingqh', 359),
	(439, NULL, '대통령은 조약을 체결·비준하고, 외교사절을 신임·접수 또는 파견하며, 선전포고와 강화를 한다.', '2018-09-15', '21:37:09', NULL, 1, '9wlpc5', 364),
	(440, NULL, '대통령이 궐위되거나 사고로 인하여 직무를 수행할 수 없을 때에는 국무총리, 법률이 정한 국무위원의 순서로 그 권한을 대행한다.', '2018-09-16', '09:47:11', NULL, 1, '9ys9z4', 396),
	(441, NULL, '정당은 법률이 정하는 바에 의하여 국가의 보호를 받으며, 국가는 법률이 정하는 바에 의하여 정당운영에 필요한 자금을 보조할 수 있다.', '2018-09-16', '11:12:50', NULL, 1, 'a1tr4t0', 364),
	(442, NULL, '대통령이 제1항의 기간내에 공포나 재의의 요구를 하지 아니한 때에도 그 법률안은 법률로서 확정된다.', '2018-09-16', '14:02:58', NULL, 1, 'a6541g', 322),
	(443, NULL, '대한민국의 경제질서는 개인과 기업의 경제상의 자유와 창의를 존중함을 기본으로 한다.', '2018-09-16', '14:07:29', NULL, 1, 'a7be89j', 308),
	(444, NULL, '법관은 헌법과 법률에 의하여 그 양심에 따라 독립하여 심판한다.', '2018-09-17', '13:21:20', NULL, 1, 'a7jn8u5s', 323),
	(445, NULL, '국회의원은 현행범인인 경우를 제외하고는 회기중 국회의 동의없이 체포 또는 구금되지 아니한다.', '2018-09-17', '15:11:09', NULL, 1, 'a9vnx1u', 311),
	(446, NULL, '헌법재판소 재판관은 정당에 가입하거나 정치에 관여할 수 없다.', '2018-09-17', '20:23:36', NULL, 1, 'ahicjzg3', 361),
	(447, NULL, '대통령은 국가의 안위에 관계되는 중대한 교전상태에 있어서 국가를 보위하기 위하여 긴급한 조치가 필요하고 국회의 집회가 불가능한 때에 한하여 법률의 효력을 가지는 명령을 발할 수 있다.', '2018-09-18', '02:58:02', NULL, 1, 'ajp1dp0', 335),
	(448, NULL, '국가는 주택개발정책등을 통하여 모든 국민이 쾌적한 주거생활을 할 수 있도록 노력하여야 한다.', '2018-09-18', '09:20:40', NULL, 1, 'akraig', 375),
	(449, NULL, '사면·감형 및 복권에 관한 사항은 법률로 정한다. 대법원장은 국회의 동의를 얻어 대통령이 임명한다.', '2018-09-18', '16:56:01', NULL, 1, 'am7e7l', 322),
	(450, NULL, '국회의원은 국회에서 직무상 행한 발언과 표결에 관하여 국회외에서 책임을 지지 아니한다.', '2018-09-18', '20:30:47', NULL, 1, 'ao4kn75', 336),
	(451, NULL, '근로자는 근로조건의 향상을 위하여 자주적인 단결권·단체교섭권 및 단체행동권을 가진다.', '2018-09-19', '01:47:17', NULL, 1, '00htfxgy', 115),
	(452, NULL, '국무총리는 국무위원의 해임을 대통령에게 건의할 수 있다. 국회의원의 수는 법률로 정하되, 200인 이상으로 한다.', '2018-09-19', '05:41:34', NULL, 1, '00vfwm', 157),
	(453, NULL, '국회가 재적의원 과반수의 찬성으로 계엄의 해제를 요구한 때에는 대통령은 이를 해제하여야 한다.', '2018-09-19', '06:09:07', NULL, 1, '01xy43o6', 109),
	(454, NULL, '국회의원은 국가이익을 우선하여 양심에 따라 직무를 행한다.', '2018-09-19', '08:51:34', NULL, 1, '028138es', 110),
	(455, NULL, '대한민국의 국민이 되는 요건은 법률로 정한다. 국회는 정부의 동의없이 정부가 제출한 지출예산 각항의 금액을 증가하거나 새 비목을 설치할 수 없다.', '2018-09-19', '15:02:27', NULL, 1, '03cwjne', 120),
	(456, NULL, '모든 국민은 주거의 자유를 침해받지 아니한다. 주거에 대한 압수나 수색을 할 때에는 검사의 신청에 의하여 법관이 발부한 영장을 제시하여야 한다.', '2018-09-20', '08:14:55', NULL, 1, '056t0oay', 184),
	(457, NULL, '모든 국민은 사생활의 비밀과 자유를 침해받지 아니한다. 국회는 헌법 또는 법률에 특별한 규정이 없는 한 재적의원 과반수의 출석과 출석의원 과반수의 찬성으로 의결한다. 가부동수인 때에는 부결된 것으로 본다.', '2018-09-20', '21:34:01', NULL, 1, '07fce0', 130),
	(458, NULL, '국민의 모든 자유와 권리는 국가안전보장·질서유지 또는 공공복리를 위하여 필요한 경우에 한하여 법률로써 제한할 수 있으며, 제한하는 경우에도 자유와 권리의 본질적인 내용을 침해할 수 없다.', '2018-09-21', '05:01:36', NULL, 1, '07s5t8w', 114),
	(459, NULL, '대법원장의 임기는 6년으로 하며, 중임할 수 없다. 국회에 제출된 법률안 기타의 의안은 회기중에 의결되지 못한 이유로 폐기되지 아니한다. 다만, 국회의원의 임기가 만료된 때에는 그러하지 아니하다.', '2018-09-21', '07:15:11', NULL, 1, '095n6z8r', 107),
	(460, NULL, '대통령은 국가의 원수이며, 외국에 대하여 국가를 대표한다. 국가는 노인과 청소년의 복지향상을 위한 정책을 실시할 의무를 진다.', '2018-09-22', '07:58:43', NULL, 1, '0cjy3a', 150),
	(461, NULL, '모든 국민은 통신의 비밀을 침해받지 아니한다. 국회에서 의결된 법률안은 정부에 이송되어 15일 이내에 대통령이 공포한다.', '2018-09-22', '10:44:34', NULL, 1, '0dsnsaqx', 193),
	(462, NULL, '탄핵소추의 의결을 받은 자는 탄핵심판이 있을 때까지 그 권한행사가 정지된다.', '2018-09-22', '10:56:27', NULL, 1, '0f1grt', 152),
	(463, NULL, '국회는 국가의 예산안을 심의·확정한다. 제2항의 재판관중 3인은 국회에서 선출하는 자를, 3인은 대법원장이 지명하는 자를 임명한다.', '2018-09-22', '11:55:00', NULL, 1, '0fjkpci', 177),
	(464, NULL, '민주평화통일자문회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다.', '2018-09-22', '12:34:14', NULL, 1, '0i065rd', 135),
	(465, NULL, '법관이 중대한 심신상의 장해로 직무를 수행할 수 없을 때에는 법률이 정하는 바에 의하여 퇴직하게 할 수 있다.', '2018-09-23', '04:47:37', NULL, 1, '0k07uyvt', 109),
	(466, NULL, '국회는 상호원조 또는 안전보장에 관한 조약, 중요한 국제조직에 관한 조약, 우호통상항해조약, 주권의 제약에 관한 조약, 강화조약, 국가나 국민에게 중대한 재정적 부담을 지우는 조약 또는 입법사항에 관한 조약의 체결·비준에 대한 동의권을 가진다.', '2018-09-23', '11:48:56', NULL, 1, '0odyf7', 140),
	(467, NULL, '모든 국민은 법률이 정하는 바에 의하여 국방의 의무를 진다.', '2018-09-23', '11:58:37', NULL, 1, '0pvhd4i', 127),
	(468, NULL, '국회는 의원의 자격을 심사하며, 의원을 징계할 수 있다. 대법원은 법률에 저촉되지 아니하는 범위안에서 소송에 관한 절차, 법원의 내부규율과 사무처리에 관한 규칙을 제정할 수 있다.', '2018-09-23', '14:07:16', NULL, 1, '0r79ew', 115),
	(469, NULL, '이 헌법시행 당시의 대법원장과 대법원판사가 아닌 법관은 제1항 단서의 규정에 불구하고 이 헌법에 의하여 임명된 것으로 본다.', '2018-09-23', '17:54:32', NULL, 1, '0s3o0a8', 114),
	(470, NULL, '헌법재판소는 법관의 자격을 가진 9인의 재판관으로 구성하며, 재판관은 대통령이 임명한다.', '2018-09-23', '20:53:49', NULL, 1, '0wzgq465', 199),
	(471, NULL, '감사원의 조직·직무범위·감사위원의 자격·감사대상공무원의 범위 기타 필요한 사항은 법률로 정한다.', '2018-09-24', '01:29:51', NULL, 1, '0yxbkze', 121),
	(472, NULL, '국민의 모든 자유와 권리는 국가안전보장·질서유지 또는 공공복리를 위하여 필요한 경우에 한하여 법률로써 제한할 수 있으며, 제한하는 경우에도 자유와 권리의 본질적인 내용을 침해할 수 없다.', '2018-09-24', '07:03:53', NULL, 1, '123lizty', 155),
	(473, NULL, '이 헌법공포 당시의 국회의원의 임기는 제1항에 의한 국회의 최초의 집회일 전일까지로 한다.', '2018-09-24', '20:03:03', NULL, 1, '12udti2', 190),
	(474, NULL, '통신·방송의 시설기준과 신문의 기능을 보장하기 위하여 필요한 사항은 법률로 정한다.', '2018-09-25', '11:43:54', NULL, 1, '15z9b0o', 194),
	(475, NULL, '모든 국민은 법률이 정하는 바에 의하여 납세의 의무를 진다.', '2018-09-25', '20:08:10', NULL, 1, '16tn0v', 103),
	(476, NULL, '모든 국민은 법률이 정하는 바에 의하여 선거권을 가진다. 모든 국민은 사생활의 비밀과 자유를 침해받지 아니한다.', '2018-09-25', '20:59:31', NULL, 1, '18pt1q', 119),
	(477, NULL, '법률이 헌법에 위반되는 여부가 재판의 전제가 된 경우에는 법원은 헌법재판소에 제청하여 그 심판에 의하여 재판한다.', '2018-09-25', '22:49:37', NULL, 1, '194d3zm', 173),
	(478, NULL, '헌법재판소에서 법률의 위헌결정, 탄핵의 결정, 정당해산의 결정 또는 헌법소원에 관한 인용결정을 할 때에는 재판관 6인 이상의 찬성이 있어야 한다.', '2018-09-26', '07:56:56', NULL, 1, '1acvaymh', 121),
	(479, NULL, '모든 국민은 학문과 예술의 자유를 가진다. 이 헌법시행 당시의 법령과 조약은 이 헌법에 위배되지 아니하는 한 그 효력을 지속한다.', '2018-09-26', '10:07:43', NULL, 1, '1apd30k3', 160),
	(480, NULL, '한 회계연도를 넘어 계속하여 지출할 필요가 있을 때에는 정부는 연한을 정하여 계속비로서 국회의 의결을 얻어야 한다.', '2018-09-26', '14:01:38', NULL, 1, '1bxyo1o1', 133),
	(481, NULL, '국가는 농업 및 어업을 보호·육성하기 위하여 농·어촌종합개발과 그 지원등 필요한 계획을 수립·시행하여야 한다.', '2018-09-26', '19:08:56', NULL, 1, '1cbsi7', 183),
	(482, NULL, '대통령은 조약을 체결·비준하고, 외교사절을 신임·접수 또는 파견하며, 선전포고와 강화를 한다.', '2018-09-26', '21:07:34', NULL, 1, '1ee5p8t', 198),
	(483, NULL, '언론·출판은 타인의 명예나 권리 또는 공중도덕이나 사회윤리를 침해하여서는 아니된다. 언론·출판이 타인의 명예나 권리를 침해한 때에는 피해자는 이에 대한 피해의 배상을 청구할 수 있다.', '2018-09-26', '21:38:07', NULL, 1, '1elf5pu', 114),
	(484, NULL, '헌법재판소는 법관의 자격을 가진 9인의 재판관으로 구성하며, 재판관은 대통령이 임명한다.', '2018-09-27', '03:51:49', NULL, 1, '1lhcd7', 141),
	(485, NULL, '국토와 자원은 국가의 보호를 받으며, 국가는 그 균형있는 개발과 이용을 위하여 필요한 계획을 수립한다.', '2018-09-27', '04:02:56', NULL, 1, '1qmppxys', 118),
	(486, NULL, '헌법재판소 재판관은 탄핵 또는 금고 이상의 형의 선고에 의하지 아니하고는 파면되지 아니한다.', '2018-09-27', '08:13:19', NULL, 1, '1tdeyoq', 160),
	(487, NULL, '대통령이 궐위되거나 사고로 인하여 직무를 수행할 수 없을 때에는 국무총리, 법률이 정한 국무위원의 순서로 그 권한을 대행한다.', '2018-09-27', '16:44:10', NULL, 1, '1u3k7wf', 199),
	(488, NULL, '국회의원의 선거구와 비례대표제 기타 선거에 관한 사항은 법률로 정한다.', '2018-09-27', '18:36:53', NULL, 1, '1w52gjgj', 147),
	(489, NULL, '대통령의 국법상 행위는 문서로써 하며, 이 문서에는 국무총리와 관계 국무위원이 부서한다. 군사에 관한 것도 또한 같다.', '2018-09-27', '23:40:36', NULL, 1, '1yuo0xy', 143),
	(490, NULL, '비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도, 언론·출판·집회·결사의 자유, 정부나 법원의 권한에 관하여 특별한 조치를 할 수 있다.', '2018-09-28', '04:54:43', NULL, 1, '22mzjg', 175),
	(491, NULL, '대법관은 대법원장의 제청으로 국회의 동의를 얻어 대통령이 임명한다.', '2018-09-28', '20:49:01', NULL, 1, '24gpdj7', 180),
	(492, NULL, '전직대통령의 신분과 예우에 관하여는 법률로 정한다. 헌법재판소는 법률에 저촉되지 아니하는 범위안에서 심판에 관한 절차, 내부규율과 사무처리에 관한 규칙을 제정할 수 있다.', '2018-09-29', '03:59:30', NULL, 1, '26mw4o', 142),
	(493, NULL, '신체장애자 및 질병·노령 기타의 사유로 생활능력이 없는 국민은 법률이 정하는 바에 의하여 국가의 보호를 받는다.', '2018-09-29', '21:37:38', NULL, 1, '2e8ddewx', 182),
	(494, NULL, '선거운동은 각급 선거관리위원회의 관리하에 법률이 정하는 범위안에서 하되, 균등한 기회가 보장되어야 한다.', '2018-09-30', '07:45:52', NULL, 1, '2lehfw1', 127),
	(495, NULL, '국가는 주택개발정책등을 통하여 모든 국민이 쾌적한 주거생활을 할 수 있도록 노력하여야 한다.', '2018-10-01', '06:37:17', NULL, 1, '2m4edli7', 117),
	(496, NULL, '이 헌법중 공무원의 임기 또는 중임제한에 관한 규정은 이 헌법에 의하여 그 공무원이 최초로 선출 또는 임명된 때로부터 적용한다.', '2018-10-01', '10:54:29', NULL, 1, '2ogxhx', 171),
	(497, NULL, '국회의원이 회기전에 체포 또는 구금된 때에는 현행범인이 아닌 한 국회의 요구가 있으면 회기중 석방된다.', '2018-10-03', '01:06:26', NULL, 1, '2tnvek', 132),
	(498, NULL, '선거와 국민투표의 공정한 관리 및 정당에 관한 사무를 처리하기 위하여 선거관리위원회를 둔다.', '2018-10-04', '01:35:54', NULL, 1, '2uu3838', 177),
	(499, NULL, '국가는 국민 모두의 생산 및 생활의 기반이 되는 국토의 효율적이고 균형있는 이용·개발과 보전을 위하여 법률이 정하는 바에 의하여 그에 관한 필요한 제한과 의무를 과할 수 있다.', '2018-10-04', '03:13:23', NULL, 1, '2wn435rq', 126),
	(500, NULL, '국무위원은 국정에 관하여 대통령을 보좌하며, 국무회의의 구성원으로서 국정을 심의한다.', '2018-10-04', '17:41:02', NULL, 1, '2yqpf8', 116),
	(501, NULL, '모든 국민은 인간으로서의 존엄과 가치를 가지며, 행복을 추구할 권리를 가진다. 국가는 개인이 가지는 불가침의 기본적 인권을 확인하고 이를 보장할 의무를 진다.', '2018-10-04', '18:12:42', NULL, 1, '31naa4', 104),
	(502, NULL, '국회에서 의결된 법률안은 정부에 이송되어 15일 이내에 대통령이 공포한다.', '2018-10-04', '19:42:15', NULL, 1, '35v1m5g', 197),
	(503, NULL, '국회가 재적의원 과반수의 찬성으로 계엄의 해제를 요구한 때에는 대통령은 이를 해제하여야 한다.', '2018-10-04', '20:21:35', NULL, 1, '38kdie8m', 126),
	(504, NULL, '혼인과 가족생활은 개인의 존엄과 양성의 평등을 기초로 성립되고 유지되어야 하며, 국가는 이를 보장한다.', '2018-10-05', '07:00:37', NULL, 1, '3aizxuy', 125),
	(505, NULL, '국회의원은 국회에서 직무상 행한 발언과 표결에 관하여 국회외에서 책임을 지지 아니한다.', '2018-10-05', '09:12:57', NULL, 1, '3b22k0h', 194),
	(506, NULL, '국가는 모성의 보호를 위하여 노력하여야 한다. 선거와 국민투표의 공정한 관리 및 정당에 관한 사무를 처리하기 위하여 선거관리위원회를 둔다.', '2018-10-05', '17:40:24', NULL, 1, '3c4fewmy', 111),
	(507, NULL, '국토와 자원은 국가의 보호를 받으며, 국가는 그 균형있는 개발과 이용을 위하여 필요한 계획을 수립한다.', '2018-10-06', '00:28:44', NULL, 1, '3rf6esh', 171),
	(508, NULL, '대한민국은 국제평화의 유지에 노력하고 침략적 전쟁을 부인한다.', '2018-10-06', '02:08:12', NULL, 1, '3rnryr4k', 116),
	(509, NULL, '국가는 청원에 대하여 심사할 의무를 진다. 국회의원의 수는 법률로 정하되, 200인 이상으로 한다.', '2018-10-06', '08:05:46', NULL, 1, '3u8sha', 164),
	(510, NULL, '법관은 헌법과 법률에 의하여 그 양심에 따라 독립하여 심판한다.', '2018-10-06', '12:54:26', NULL, 1, '3ztpxou', 114),
	(511, NULL, '계엄을 선포한 때에는 대통령은 지체없이 국회에 통고하여야 한다.', '2018-10-06', '14:22:17', NULL, 1, '42xua1', 108),
	(512, NULL, '모든 국민은 양심의 자유를 가진다. 헌법개정안이 제2항의 찬성을 얻은 때에는 헌법개정은 확정되며, 대통령은 즉시 이를 공포하여야 한다.', '2018-10-06', '15:47:22', NULL, 1, '43fkkvn', 164),
	(513, NULL, '국회는 국정을 감사하거나 특정한 국정사안에 대하여 조사할 수 있으며, 이에 필요한 서류의 제출 또는 증인의 출석과 증언이나 의견의 진술을 요구할 수 있다.', '2018-10-06', '16:14:08', NULL, 1, '44rqhfl', 166),
	(514, NULL, '탄핵소추의 의결을 받은 자는 탄핵심판이 있을 때까지 그 권한행사가 정지된다.', '2018-10-07', '02:34:36', NULL, 1, '4b12x5e', 109),
	(515, NULL, '국가는 재해를 예방하고 그 위험으로부터 국민을 보호하기 위하여 노력하여야 한다.', '2018-10-07', '09:25:36', NULL, 1, '4cqqzrr', 141),
	(516, NULL, '국방상 또는 국민경제상 긴절한 필요로 인하여 법률이 정하는 경우를 제외하고는, 사영기업을 국유 또는 공유로 이전하거나 그 경영을 통제 또는 관리할 수 없다.', '2018-10-07', '09:25:40', NULL, 1, '4e9nxi', 167),
	(517, NULL, '국회는 상호원조 또는 안전보장에 관한 조약, 중요한 국제조직에 관한 조약, 우호통상항해조약, 주권의 제약에 관한 조약, 강화조약, 국가나 국민에게 중대한 재정적 부담을 지우는 조약 또는 입법사항에 관한 조약의 체결·비준에 대한 동의권을 가진다.', '2018-10-07', '10:18:50', NULL, 1, '4l7zqm', 121),
	(518, NULL, '선거에 있어서 최고득표자가 2인 이상인 때에는 국회의 재적의원 과반수가 출석한 공개회의에서 다수표를 얻은 자를 당선자로 한다.', '2018-10-07', '17:47:16', NULL, 1, '4mu9nipm', 113),
	(519, NULL, '국무회의는 정부의 권한에 속하는 중요한 정책을 심의한다. 국무총리는 국회의 동의를 얻어 대통령이 임명한다.', '2018-10-08', '02:27:18', NULL, 1, '4tnx1py', 169),
	(520, NULL, '국회의원의 선거구와 비례대표제 기타 선거에 관한 사항은 법률로 정한다.', '2018-10-08', '07:02:35', NULL, 1, '4u733y', 185),
	(521, NULL, '형사피고인은 유죄의 판결이 확정될 때까지는 무죄로 추정된다.', '2018-10-08', '20:23:05', NULL, 1, '4uy8m6a7', 182),
	(522, NULL, '국가는 주택개발정책등을 통하여 모든 국민이 쾌적한 주거생활을 할 수 있도록 노력하여야 한다.', '2018-10-09', '12:17:24', NULL, 1, '4ycsjq7b', 126),
	(523, NULL, '국회의원의 선거구와 비례대표제 기타 선거에 관한 사항은 법률로 정한다.', '2018-10-09', '19:44:24', NULL, 1, '4zpg83b', 175),
	(524, NULL, '국군의 조직과 편성은 법률로 정한다. 모든 국민은 법 앞에 평등하다. 누구든지 성별·종교 또는 사회적 신분에 의하여 정치적·경제적·사회적·문화적 생활의 모든 영역에 있어서 차별을 받지 아니한다.', '2018-10-10', '05:26:04', NULL, 1, '550j9pl', 195),
	(525, NULL, '한 회계연도를 넘어 계속하여 지출할 필요가 있을 때에는 정부는 연한을 정하여 계속비로서 국회의 의결을 얻어야 한다.', '2018-10-10', '09:09:20', NULL, 1, '56ya1ugz', 197),
	(526, NULL, '의원을 제명하려면 국회재적의원 3분의 2 이상의 찬성이 있어야 한다.', '2018-10-10', '13:46:44', NULL, 1, '59vyxe', 162),
	(527, NULL, '국가는 균형있는 국민경제의 성장 및 안정과 적정한 소득의 분배를 유지하고, 시장의 지배와 경제력의 남용을 방지하며, 경제주체간의 조화를 통한 경제의 민주화를 위하여 경제에 관한 규제와 조정을 할 수 있다.', '2018-10-10', '14:16:24', NULL, 1, '5chf2sm', 176),
	(528, NULL, '비상계엄하의 군사재판은 군인·군무원의 범죄나 군사에 관한 간첩죄의 경우와 초병·초소·유독음식물공급·포로에 관한 죄중 법률이 정한 경우에 한하여 단심으로 할 수 있다. 다만, 사형을 선고한 경우에는 그러하지 아니하다.', '2018-10-10', '19:42:02', NULL, 1, '5goytzou', 116),
	(529, NULL, '혼인과 가족생활은 개인의 존엄과 양성의 평등을 기초로 성립되고 유지되어야 하며, 국가는 이를 보장한다.', '2018-10-11', '07:35:07', NULL, 1, '5hovhj', 139),
	(530, NULL, '국무총리는 국무위원의 해임을 대통령에게 건의할 수 있다. 비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도, 언론·출판·집회·결사의 자유, 정부나 법원의 권한에 관하여 특별한 조치를 할 수 있다.', '2018-10-11', '09:16:32', NULL, 1, '5lfleq', 191),
	(531, NULL, '공무원은 국민전체에 대한 봉사자이며, 국민에 대하여 책임을 진다.', '2018-10-11', '15:23:43', NULL, 1, '5lfmn4', 154),
	(532, NULL, '대통령은 국가의 독립·영토의 보전·국가의 계속성과 헌법을 수호할 책무를 진다.', '2018-10-11', '23:20:27', NULL, 1, '5ov0pl', 172),
	(533, NULL, '국무회의는 정부의 권한에 속하는 중요한 정책을 심의한다. 외국인은 국제법과 조약이 정하는 바에 의하여 그 지위가 보장된다.', '2018-10-12', '01:49:33', NULL, 1, '5ryot7z', 181),
	(534, NULL, '대통령의 임기가 만료되는 때에는 임기만료 70일 내지 40일전에 후임자를 선거한다.', '2018-10-12', '04:04:00', NULL, 1, '62ivzjp', 161),
	(535, NULL, '환경권의 내용과 행사에 관하여는 법률로 정한다. 정당의 목적이나 활동이 민주적 기본질서에 위배될 때에는 정부는 헌법재판소에 그 해산을 제소할 수 있고, 정당은 헌법재판소의 심판에 의하여 해산된다.', '2018-10-12', '12:33:27', NULL, 1, '62x7xr', 167),
	(536, NULL, '모든 국민은 보건에 관하여 국가의 보호를 받는다. 감사원은 원장을 포함한 5인 이상 11인 이하의 감사위원으로 구성한다.', '2018-10-12', '16:41:30', NULL, 1, '64aha9e', 172),
	(537, NULL, '대통령의 임기연장 또는 중임변경을 위한 헌법개정은 그 헌법개정 제안 당시의 대통령에 대하여는 효력이 없다.', '2018-10-12', '22:21:03', NULL, 1, '67nx7s', 106),
	(538, NULL, '모든 국민은 법률이 정하는 바에 의하여 공무담임권을 가진다.', '2018-10-13', '04:30:18', NULL, 1, '687xyqis', 167),
	(539, NULL, '대통령은 조약을 체결·비준하고, 외교사절을 신임·접수 또는 파견하며, 선전포고와 강화를 한다.', '2018-10-14', '01:43:39', NULL, 1, '6b5cd18u', 114),
	(540, NULL, '대통령이 궐위되거나 사고로 인하여 직무를 수행할 수 없을 때에는 국무총리, 법률이 정한 국무위원의 순서로 그 권한을 대행한다.', '2018-10-14', '04:35:05', NULL, 1, '6h5rb5jt', 151),
	(541, NULL, '정당은 법률이 정하는 바에 의하여 국가의 보호를 받으며, 국가는 법률이 정하는 바에 의하여 정당운영에 필요한 자금을 보조할 수 있다.', '2018-10-14', '07:03:08', NULL, 1, '6k56iy', 112),
	(542, NULL, '대통령이 제1항의 기간내에 공포나 재의의 요구를 하지 아니한 때에도 그 법률안은 법률로서 확정된다.', '2018-10-14', '08:55:27', NULL, 1, '6p5s0ii7', 156),
	(543, NULL, '대한민국의 경제질서는 개인과 기업의 경제상의 자유와 창의를 존중함을 기본으로 한다.', '2018-10-14', '09:43:21', NULL, 1, '6scga0', 155),
	(544, NULL, '법관은 헌법과 법률에 의하여 그 양심에 따라 독립하여 심판한다.', '2018-10-14', '20:21:17', NULL, 1, '6tdinu', 104),
	(545, NULL, '국회의원은 현행범인인 경우를 제외하고는 회기중 국회의 동의없이 체포 또는 구금되지 아니한다.', '2018-10-15', '03:44:31', NULL, 1, '70ya99', 198),
	(546, NULL, '헌법재판소 재판관은 정당에 가입하거나 정치에 관여할 수 없다.', '2018-10-15', '09:26:26', NULL, 1, '73rml8', 129),
	(547, NULL, '대통령은 국가의 안위에 관계되는 중대한 교전상태에 있어서 국가를 보위하기 위하여 긴급한 조치가 필요하고 국회의 집회가 불가능한 때에 한하여 법률의 효력을 가지는 명령을 발할 수 있다.', '2018-10-15', '10:21:11', NULL, 1, '77p0s8', 140),
	(548, NULL, '국가는 주택개발정책등을 통하여 모든 국민이 쾌적한 주거생활을 할 수 있도록 노력하여야 한다.', '2018-10-15', '10:22:31', NULL, 1, '78603e', 119),
	(549, NULL, '사면·감형 및 복권에 관한 사항은 법률로 정한다. 대법원장은 국회의 동의를 얻어 대통령이 임명한다.', '2018-10-15', '21:07:28', NULL, 1, '79xdxy', 105),
	(550, NULL, '국회의원은 국회에서 직무상 행한 발언과 표결에 관하여 국회외에서 책임을 지지 아니한다.', '2018-10-15', '22:34:35', NULL, 1, '7fcx1cl', 133),
	(551, NULL, '근로자는 근로조건의 향상을 위하여 자주적인 단결권·단체교섭권 및 단체행동권을 가진다.', '2018-10-16', '00:50:19', NULL, 1, '7g44td', 148),
	(552, NULL, '국무총리는 국무위원의 해임을 대통령에게 건의할 수 있다. 국회의원의 수는 법률로 정하되, 200인 이상으로 한다.', '2018-10-16', '11:57:19', NULL, 1, '7gemat7w', 156),
	(553, NULL, '국회가 재적의원 과반수의 찬성으로 계엄의 해제를 요구한 때에는 대통령은 이를 해제하여야 한다.', '2018-10-16', '13:48:01', NULL, 1, '7hrtd4', 192),
	(554, NULL, '국회의원은 국가이익을 우선하여 양심에 따라 직무를 행한다.', '2018-10-16', '20:47:40', NULL, 1, '7hv13l', 152),
	(555, NULL, '대한민국의 국민이 되는 요건은 법률로 정한다. 국회는 정부의 동의없이 정부가 제출한 지출예산 각항의 금액을 증가하거나 새 비목을 설치할 수 없다.', '2018-10-17', '23:40:01', NULL, 1, '7mf9vf6i', 179),
	(556, NULL, '모든 국민은 주거의 자유를 침해받지 아니한다. 주거에 대한 압수나 수색을 할 때에는 검사의 신청에 의하여 법관이 발부한 영장을 제시하여야 한다.', '2018-10-18', '03:15:03', NULL, 1, '7pjujt', 172),
	(557, NULL, '모든 국민은 사생활의 비밀과 자유를 침해받지 아니한다. 국회는 헌법 또는 법률에 특별한 규정이 없는 한 재적의원 과반수의 출석과 출석의원 과반수의 찬성으로 의결한다. 가부동수인 때에는 부결된 것으로 본다.', '2018-10-18', '04:21:10', NULL, 1, '7qwpp94', 165),
	(558, NULL, '국민의 모든 자유와 권리는 국가안전보장·질서유지 또는 공공복리를 위하여 필요한 경우에 한하여 법률로써 제한할 수 있으며, 제한하는 경우에도 자유와 권리의 본질적인 내용을 침해할 수 없다.', '2018-10-18', '08:36:12', NULL, 1, '7sc86j', 140),
	(559, NULL, '대법원장의 임기는 6년으로 하며, 중임할 수 없다. 국회에 제출된 법률안 기타의 의안은 회기중에 의결되지 못한 이유로 폐기되지 아니한다. 다만, 국회의원의 임기가 만료된 때에는 그러하지 아니하다.', '2018-10-18', '22:02:14', NULL, 1, '80eim7', 136),
	(560, NULL, '대통령은 국가의 원수이며, 외국에 대하여 국가를 대표한다. 국가는 노인과 청소년의 복지향상을 위한 정책을 실시할 의무를 진다.', '2018-10-19', '22:25:12', NULL, 1, '80qzdt', 126),
	(561, NULL, '모든 국민은 통신의 비밀을 침해받지 아니한다. 국회에서 의결된 법률안은 정부에 이송되어 15일 이내에 대통령이 공포한다.', '2018-10-20', '00:55:53', NULL, 1, '81jnoy6', 148),
	(562, NULL, '탄핵소추의 의결을 받은 자는 탄핵심판이 있을 때까지 그 권한행사가 정지된다.', '2018-10-20', '07:33:21', NULL, 1, '82ktjac', 167),
	(563, NULL, '국회는 국가의 예산안을 심의·확정한다. 제2항의 재판관중 3인은 국회에서 선출하는 자를, 3인은 대법원장이 지명하는 자를 임명한다.', '2018-10-20', '07:45:34', NULL, 1, '84jb8yrv', 100),
	(564, NULL, '민주평화통일자문회의의 조직·직무범위 기타 필요한 사항은 법률로 정한다.', '2018-10-20', '10:28:07', NULL, 1, '85ms80h', 109),
	(565, NULL, '법관이 중대한 심신상의 장해로 직무를 수행할 수 없을 때에는 법률이 정하는 바에 의하여 퇴직하게 할 수 있다.', '2018-10-20', '14:20:40', NULL, 1, '8exwhr', 146),
	(566, NULL, '국회는 상호원조 또는 안전보장에 관한 조약, 중요한 국제조직에 관한 조약, 우호통상항해조약, 주권의 제약에 관한 조약, 강화조약, 국가나 국민에게 중대한 재정적 부담을 지우는 조약 또는 입법사항에 관한 조약의 체결·비준에 대한 동의권을 가진다.', '2018-10-21', '03:17:27', NULL, 1, '8eyx5o', 174),
	(567, NULL, '모든 국민은 법률이 정하는 바에 의하여 국방의 의무를 진다.', '2018-10-22', '03:04:52', NULL, 1, '8g4bul6', 196),
	(568, NULL, '국회는 의원의 자격을 심사하며, 의원을 징계할 수 있다. 대법원은 법률에 저촉되지 아니하는 범위안에서 소송에 관한 절차, 법원의 내부규율과 사무처리에 관한 규칙을 제정할 수 있다.', '2018-10-22', '04:10:34', NULL, 1, '8g4j88s', 152),
	(569, NULL, '이 헌법시행 당시의 대법원장과 대법원판사가 아닌 법관은 제1항 단서의 규정에 불구하고 이 헌법에 의하여 임명된 것으로 본다.', '2018-10-22', '09:51:04', NULL, 1, '8hfbm2zh', 154),
	(570, NULL, '헌법재판소는 법관의 자격을 가진 9인의 재판관으로 구성하며, 재판관은 대통령이 임명한다.', '2018-10-22', '13:45:29', NULL, 1, '8jihlhh', 152),
	(571, NULL, '감사원의 조직·직무범위·감사위원의 자격·감사대상공무원의 범위 기타 필요한 사항은 법률로 정한다.', '2018-10-23', '07:58:02', NULL, 1, '8nwc5b', 162),
	(572, NULL, '국민의 모든 자유와 권리는 국가안전보장·질서유지 또는 공공복리를 위하여 필요한 경우에 한하여 법률로써 제한할 수 있으며, 제한하는 경우에도 자유와 권리의 본질적인 내용을 침해할 수 없다.', '2018-10-23', '17:03:52', NULL, 1, '8o218yfz', 194),
	(573, NULL, '이 헌법공포 당시의 국회의원의 임기는 제1항에 의한 국회의 최초의 집회일 전일까지로 한다.', '2018-10-24', '15:18:12', NULL, 1, '8p5ukxe', 193),
	(574, NULL, '통신·방송의 시설기준과 신문의 기능을 보장하기 위하여 필요한 사항은 법률로 정한다.', '2018-10-24', '19:35:56', NULL, 1, '8qe051wg', 118),
	(575, NULL, '모든 국민은 법률이 정하는 바에 의하여 납세의 의무를 진다.', '2018-10-24', '23:36:06', NULL, 1, '8r22v0b', 135),
	(576, NULL, '모든 국민은 법률이 정하는 바에 의하여 선거권을 가진다. 모든 국민은 사생활의 비밀과 자유를 침해받지 아니한다.', '2018-10-25', '00:54:09', NULL, 1, '8rietys', 191),
	(577, NULL, '법률이 헌법에 위반되는 여부가 재판의 전제가 된 경우에는 법원은 헌법재판소에 제청하여 그 심판에 의하여 재판한다.', '2018-10-25', '01:12:47', NULL, 1, '92i8bu7', 146),
	(578, NULL, '헌법재판소에서 법률의 위헌결정, 탄핵의 결정, 정당해산의 결정 또는 헌법소원에 관한 인용결정을 할 때에는 재판관 6인 이상의 찬성이 있어야 한다.', '2018-10-25', '12:15:24', NULL, 1, '92ianotb', 126),
	(579, NULL, '모든 국민은 학문과 예술의 자유를 가진다. 이 헌법시행 당시의 법령과 조약은 이 헌법에 위배되지 아니하는 한 그 효력을 지속한다.', '2018-10-26', '02:55:54', NULL, 1, '95g2ntb', 141),
	(580, NULL, '한 회계연도를 넘어 계속하여 지출할 필요가 있을 때에는 정부는 연한을 정하여 계속비로서 국회의 의결을 얻어야 한다.', '2018-10-26', '06:25:17', NULL, 1, '95sl7a5t', 194),
	(581, NULL, '국가는 농업 및 어업을 보호·육성하기 위하여 농·어촌종합개발과 그 지원등 필요한 계획을 수립·시행하여야 한다.', '2018-10-26', '10:41:57', NULL, 1, '9a3vbh8a', 102),
	(582, NULL, '대통령은 조약을 체결·비준하고, 외교사절을 신임·접수 또는 파견하며, 선전포고와 강화를 한다.', '2018-10-26', '13:05:41', NULL, 1, '9aumaeg', 117),
	(583, NULL, '언론·출판은 타인의 명예나 권리 또는 공중도덕이나 사회윤리를 침해하여서는 아니된다. 언론·출판이 타인의 명예나 권리를 침해한 때에는 피해자는 이에 대한 피해의 배상을 청구할 수 있다.', '2018-10-26', '13:22:37', NULL, 1, '9awftpg', 191),
	(584, NULL, '헌법재판소는 법관의 자격을 가진 9인의 재판관으로 구성하며, 재판관은 대통령이 임명한다.', '2018-10-26', '20:03:28', NULL, 1, '9civphco', 112),
	(585, NULL, '국토와 자원은 국가의 보호를 받으며, 국가는 그 균형있는 개발과 이용을 위하여 필요한 계획을 수립한다.', '2018-10-26', '20:25:58', NULL, 1, '9dih6h', 155),
	(586, NULL, '헌법재판소 재판관은 탄핵 또는 금고 이상의 형의 선고에 의하지 아니하고는 파면되지 아니한다.', '2018-10-27', '03:15:15', NULL, 1, '9h3xgnq', 172),
	(587, NULL, '대통령이 궐위되거나 사고로 인하여 직무를 수행할 수 없을 때에는 국무총리, 법률이 정한 국무위원의 순서로 그 권한을 대행한다.', '2018-10-27', '10:08:52', NULL, 1, '9kz4at5n', 182),
	(588, NULL, '국회의원의 선거구와 비례대표제 기타 선거에 관한 사항은 법률로 정한다.', '2018-10-27', '10:53:15', NULL, 1, '9m3jhx', 160),
	(589, NULL, '대통령의 국법상 행위는 문서로써 하며, 이 문서에는 국무총리와 관계 국무위원이 부서한다. 군사에 관한 것도 또한 같다.', '2018-10-28', '02:17:50', NULL, 1, '9piki7k', 196),
	(590, NULL, '비상계엄이 선포된 때에는 법률이 정하는 바에 의하여 영장제도, 언론·출판·집회·결사의 자유, 정부나 법원의 권한에 관하여 특별한 조치를 할 수 있다.', '2018-10-28', '06:08:42', NULL, 1, '9pzorj', 116),
	(591, NULL, '대법관은 대법원장의 제청으로 국회의 동의를 얻어 대통령이 임명한다.', '2018-10-28', '14:56:22', NULL, 1, '9rfwd2sd', 141),
	(592, NULL, '전직대통령의 신분과 예우에 관하여는 법률로 정한다. 헌법재판소는 법률에 저촉되지 아니하는 범위안에서 심판에 관한 절차, 내부규율과 사무처리에 관한 규칙을 제정할 수 있다.', '2018-10-28', '18:48:40', NULL, 1, '9wbc65og', 164),
	(593, NULL, '신체장애자 및 질병·노령 기타의 사유로 생활능력이 없는 국민은 법률이 정하는 바에 의하여 국가의 보호를 받는다.', '2018-10-28', '22:44:57', NULL, 1, '9xtl6di', 183),
	(594, NULL, '선거운동은 각급 선거관리위원회의 관리하에 법률이 정하는 범위안에서 하되, 균등한 기회가 보장되어야 한다.', '2018-10-29', '00:32:01', NULL, 1, '9yixbt5h', 138),
	(595, NULL, '국가는 주택개발정책등을 통하여 모든 국민이 쾌적한 주거생활을 할 수 있도록 노력하여야 한다.', '2018-10-29', '09:50:37', NULL, 1, 'a27wkt', 182),
	(596, NULL, '이 헌법중 공무원의 임기 또는 중임제한에 관한 규정은 이 헌법에 의하여 그 공무원이 최초로 선출 또는 임명된 때로부터 적용한다.', '2018-10-29', '14:01:41', NULL, 1, 'a5z8gt', 161),
	(597, NULL, '국회의원이 회기전에 체포 또는 구금된 때에는 현행범인이 아닌 한 국회의 요구가 있으면 회기중 석방된다.', '2018-10-29', '16:26:48', NULL, 1, 'a6sls4bw', 134),
	(598, NULL, '선거와 국민투표의 공정한 관리 및 정당에 관한 사무를 처리하기 위하여 선거관리위원회를 둔다.', '2018-10-29', '18:58:54', NULL, 1, 'a8ium2', 164),
	(599, NULL, '국가는 국민 모두의 생산 및 생활의 기반이 되는 국토의 효율적이고 균형있는 이용·개발과 보전을 위하여 법률이 정하는 바에 의하여 그에 관한 필요한 제한과 의무를 과할 수 있다.', '2018-10-29', '20:16:57', NULL, 1, 'a8rlldl6', 103),
	(600, NULL, '국무위원은 국정에 관하여 대통령을 보좌하며, 국무회의의 구성원으로서 국정을 심의한다.', '2018-10-29', '23:46:32', NULL, 1, 'adoh5vnl', 110),
	(601, NULL, '일품감자튀김 짱짱맛있어요', '2018-10-31', '09:11:05', NULL, 1, 'test1', 52),
	(602, NULL, '안녕하세요', '2018-10-31', '11:40:10', NULL, 1, '949832447', 18),
	(603, NULL, '의정부계란볶음밥', '2018-10-31', '11:41:14', NULL, 1, 'test3', 7),
	(604, NULL, '맛있어요', '2018-10-31', '11:41:18', NULL, 1, 'test1', 172);
